INSERT INTO `course` (`CourseID`, `CourseName`, `DeptID`, `Credits`, `Description`, `CourseType`) VALUES
('BS1000', 'Plants and Society', 'BIO', 3, 'A one semester lecture/laboratory course in general botany for non-science majors. The course covers the principles of plant anatomy and physiology, as well as the impact of plants and agriculture on society. Topics covered include the use and history of plants as food, medicines, and poisons.', 'Undergraduate'),
('BS2400', 'Basic Biology I', 'BIO', 2, 'Lecture first semester of freshman biology courses covering content areas including molecular and cellular biology, genetics, genomics and evolution.', 'Undergraduate'),
('BS2401', 'Basic Biology I Lab', 'BIO', 1, 'Laboratory first semester of freshman biology courses covering content areas including molecular and cellular biology, genetics, genomics and evolution.', 'Undergraduate'),
('BS2410', 'Basic Biology II', 'BIO', 2, 'Lecture second semester of freshman biology courses covering content areas including cell metabolism, comparative animal and plant anatomy and physiology and ecology.', 'Undergraduate'),
('BS2411', 'Basic Biology II Lab', 'BIO', 1, 'Laboratory second semester of freshman biology courses covering content areas including cell metabolism, comparative animal and plant anatomy and physiology and ecology.', 'Undergraduate'),
('BS2490', 'Enivronmental Science', 'BIO', 3, 'The focus of this lecture course is on the interactions of humans with their environment. Human impact on the worldâ€™s ecosystems is emphasized. The theme stressed throughout this course is that every system involving life is dependent upon maintaining balances between nutrient gains and losses, between energy inflows and outflows, and between births and deaths within populations. Against this background, various aspects of the human system, such as our use of soils, our disposal of wastes, our use of resources, land, and energy and our population, are shown to be out of balance. The consequences of these imbalances are discussed in relation to our political and economic system.', 'Undergraduate'),
('BS3400', 'Vertebrate Physiology', 'BIO', 3, 'A regulatory systems approach to the principles of animal physiology, developed through consideration of functioning of cells, tissues, and organ systems with an emphasis on humans. (With 3-hour laboratory)', 'Undergraduate'),
('BS3450', 'Plant Biology', 'BIO', 3, 'The study of plants as biological organisms. Topics include classification and evolution of the plant kingdom: plant anatomy, physiology and reproduction, with emphasis on the flowering plants. Consideration given to experimental methods used in studying plants and the importance of plants and plant studies. Students are expected to complete an experimental project or observational study. Lecture, discussion, laboratory and field trips, or audio tutorial integration of these are presented.', 'Undergraduate'),
('BS3810', 'Biological Aspects of Aging', 'BIO', 3, 'Lecture/workshop course designed for science students. Examines the aging process on the molecular, cellular, and organismic levels. Emphasizes alterations during the aging process in cells whose life span is identical to that of the entire organism. Examination of various pathological disorders in relationship to aging is also emphasized. Students are required to read original articles and be prepared to discuss current topics in workshop settings.', 'Undergraduate'),
('BS4400', 'Cell Biology', 'BIO', 3, 'Lecture/discussion/laboratory course whose content is directed to the study of the molecular basis of cell activities, cell ultra structure, and its integration with cellular function. Lectures survey the cell in its environment, energy transformation, mobility, replication of genetic material, growth, nucleocytoplasmic interactions. The laboratory explores techniques used in the study of the cell.', 'Undergraduate'),
('BS4420', 'Microbiology', 'BIO', 3, 'Lecture/laboratory course concerned with structure-function relationships in various types of microorganisms, with particular emphasis on bacteria. Nutrition, biosynthesis, energetics, growth, microbial interactions and symbiotic relationships, host-parasite relationships, and microbial genetics are among the topics discussed.', 'Undergraduate'),
('BS4460', 'Genetics', 'BIO', 3, 'Lecture/laboratory course presenting the fundamental principles of genetics, the molecular biology of the gene, and heredity in humans. Through lectures, readings, laboratories, and discussions, students examine the experimental evidence leading to currently accepted concepts, and critically analyze the implications of various findings in human genetics.', 'Undergraduate'),
('BS4461', 'Immunology', 'BIO', 3, 'Lecture/laboratory. This course will introduce students to the essential concepts of how the immune system works, what are the molecular and cellular mechanisms and pathways involved in the defense of an organism from infectious diseases or cancer, and it will describe in detail the cells and molecules of the mammalian immune system. The laboratory component is a research-based course where students participate in the development of new knowledge by generating a novel research question and performing their own experimental design.', 'Undergraduate'),
('BS4470', 'Ecology', 'BIO', 3, 'A general ecology course focused on the study of ecosystems. It fulfills the population content area course requirement for the BA and BS degrees in Biology. The course includes a lecture (3 hours/week) and a laboratory component (3 hours/week). Topics include ecosystem structure and function, population dynamics, community structure, food webs, energy flow, nutrient cycles, biogeography, associations, succession, adaptation and niche analysis, and interspecific interactions. The course is taught in a blended format with a significant online course component. The laboratory component includes extensive field work. Students working in groups must design and implement a research project involving data collection from a campus ecosystem. The project culminates in a group oral presentation. Students are also encouraged to present their results at a local or regional conference and/or submit their results for publication to a peer-reviewed undergraduate research journal', 'Undergraduate'),
('BS4560', 'Molecular Biology', 'BIO', 3, 'Lecture/Laboratory course to introduce students to both the theoretical and practical aspects of molecular biology. An understanding of molecular biology necessitates a synthesis of information from genetics, biochemistry, cell biology, physics and chemistry. The course will include microbial studies, cellular components, genes, regulation etc. The lab component will utilize techniques of genetic engineering.', 'Undergraduate'),
('BS5410', 'Seminar I: Reading in the Discipline', 'BIO', 3, 'Designed to increase ability to read in the discipline. Students will survey scientific literature, learn how to research topics, prepare abstracts, etc. Students will select a mentor and topic for Seminar II. Must be taken by students two semesters prior to graduation.', 'Undergraduate'),
('BS5420', 'Seminar II: Writing in the Discipline', 'BIO', 3, 'Designed to promote an in-depth consideration of special topics in current biological research. The course will include presentations by both external speakers and students. The student will, under the advisement of a faculty mentor, develop a topic either as a library or laboratory study and present the results both orally and as a written paper.', 'Undergraduate'),
('BS5590', 'Advanced Research', 'BIO', 3, 'Research project carried out under the supervision of a faculty member. Each project includes a survey of the appropriate original literature and investigation of a selected research topic by experimental or theoretical methods. Open to students of upperâ€‘division standing, preferably seniors, on acceptance as a research student by a faculty member. Students may take this course twice for credit but may receive only 4 credits from this course toward the major. Grading will be CR/NC.', 'Undergraduate'),
('BS5591', 'Environmental Research', 'BIO', 2, 'Research project in environmental science carried out under supervision of a faculty member. Open to upperâ€‘division students, preferably seniors on acceptance as a research student by a faculty member.', 'Undergraduate'),
('BS5592', 'Environmental Research Lab', 'BIO', 1, 'Research project in environmental science carried out under supervision of a faculty member. Open to upperâ€‘division students, preferably seniors on acceptance as a research student by a faculty member.', 'Undergraduate'),
('BS6551', 'Evolutionary Biology', 'BIO', 6, 'Explore the mechanisms and patterns of evolution, including natural selection, adaptation, speciation, and the history of life on Earth.', 'Graduate'),
('BS6552', 'Human Anatomy and Physiology', 'BIO', 6, 'Study the structure and function of the human body, including organ systems, tissues, and their interrelationships.', 'Graduate'),
('BS6553', 'Genetics and Genomics', 'BIO', 6, 'Dive into the principles of genetics, gene regulation, genetic engineering, and the role of genomics in modern biology.', 'Graduate'),
('BS6554', 'Microbial Ecology and Diversity', 'BIO', 6, 'Investigate the diversity, ecology, and significance of microorganisms in various ecosystems, including their role in biogeochemical cycles.', 'Graduate'),
('BS6555', 'Neurobiology', 'BIO', 6, 'Examine the structure and function of the nervous system, including neurons, neural circuits, and the biological basis of behavior.', 'Graduate'),
('BS6556', 'Conservation Biology', 'BIO', 6, 'Focus on the preservation and restoration of biodiversity, addressing threats to ecosystems, endangered species, and conservation strategies.', 'Graduate'),
('BS6557', 'Marine Biology', 'BIO', 6, 'Study the ecology, physiology, and diversity of marine organisms, including their adaptations to the marine environment.', 'Graduate'),
('BS6558', 'Wildlife Ecology and Management', 'BIO', 6, 'Explore the principles of wildlife ecology, conservation, and management, with an emphasis on wildlife population dynamics.', 'Graduate'),
('BS6559', 'Biotechnology and Genetic Engineering', 'BIO', 6, 'Learn about biotechnological applications in biology, including genetic engineering techniques, bioprocessing, and biopharmaceuticals.', 'Graduate'),
('BS6560', 'Advanced Topics in Molecular Biology', 'BIO', 6, 'Investigate advanced topics in molecular biology, such as epigenetics, RNA biology, and gene expression regulation.', 'Graduate'),
('BU1000', 'Entrepreneurship and Small Business Management', 'BUS', 3, 'This class would cover the fundamentals of starting and managing a small business, including business planning, marketing, finance, and operations.', 'Undergraduate'),
('BU1050', 'Marketing and Branding', 'BUS', 3, 'This class would focus on marketing strategies, brand development, and customer engagement techniques to help businesses promote their products and services effectively.', 'Undergraduate'),
('BU1200', 'Entrepreneurial Finance', 'BUS', 3, 'Examine financing options for startups and small businesses, including venture capital, angel investors, and crowdfunding.', 'Undergraduate'),
('BU1900', 'Supply Chain Logistics', 'BUS', 3, 'Study the logistics and operations of supply chain management, including inventory control, transportation, and distribution.', 'Undergraduate'),
('BU2000', 'Financial Management', 'BUS', 3, 'Financial Management: In this class, students would learn about financial planning, budgeting, investment strategies, and financial analysis to make informed business decisions.', 'Undergraduate'),
('BU2050', 'Human Resource Management', 'BUS', 3, 'This class would cover topics like hiring, training, employee relations, and workforce management, helping students understand how to build and manage a strong team.', 'Undergraduate'),
('BU2100', 'International Business and Globalization', 'BUS', 3, 'International Business and Globalization: Students would learn about the challenges and opportunities of conducting business on a global scale, including international trade, cross-cultural management, and global market entry strategies.', 'Undergraduate'),
('BU2150', 'Business Ethics and Corporate Social Responsibility', 'BUS', 3, 'This class would explore ethical dilemmas in business, sustainability, and the social responsibilities of corporations.', 'Undergraduate'),
('BU2200', 'Operations and Supply Chain Management', 'BUS', 3, 'Students would study how to optimize business processes, manage the supply chain, and improve operational efficiency.', 'Undergraduate'),
('BU2700', 'Financial Accounting', 'BUS', 3, 'Dive into financial reporting, accounting principles, and financial statement analysis to assess a business\'s financial health.', 'Undergraduate'),
('BU2800', 'Risk Management and Insurance', 'BUS', 3, 'Explore the principles of risk management, insurance options, and strategies to protect businesses from various risks and liabilities.', 'Undergraduate'),
('BU3000', 'E-Commerce and Digital Marketing', 'BUS', 3, 'This class would delve into the world of online business, covering e-commerce platforms, digital marketing techniques, and the use of technology in business.', 'Undergraduate'),
('BU3450', 'Business Law and Ethics', 'BUS', 3, 'This class would provide an overview of business law, contracts, intellectual property, and the legal and ethical framework in which businesses operate.', 'Undergraduate'),
('BU3700', 'Sales and Negotiation Skills', 'BUS', 3, 'Develop expertise in selling and negotiation techniques, as well as the building of strong client relationships for sales and business development.', 'Undergraduate'),
('BU4000', 'Business Analytics and Data Science', 'BUS', 3, 'Explore the utilization of data analytics and data science techniques for data-driven decision-making and business process optimization.', 'Undergraduate'),
('BU4500', 'Innovation and Product Development', 'BUS', 3, 'Focus on the innovation process, new product development, and the successful introduction of innovative ideas to the market.', 'Undergraduate'),
('BU5300', 'Leadership and Organizational Behavior', 'BUS', 3, 'Learn about leadership styles, motivation, and the dynamics of organizational behavior for effective leadership and management.', 'Undergraduate'),
('BU5500', 'Strategic Management', 'BUS', 3, 'Learn about strategic planning, competitive analysis, and the creation and execution of effective business strategies for long-term success.', 'Undergraduate'),
('BU5910', 'Business Communication', 'BUS', 3, 'Focus on effective written and oral communication in a business context, encompassing presentations, emails, and interpersonal communication.', 'Undergraduate'),
('BU5950', 'Business Negotiation and Conflict Resolution', 'BUS', 3, 'Develop skills and strategies for successful negotiation and conflict resolution in a business context.', 'Undergraduate'),
('BU6100', 'Strategic Management', 'BUS', 6, 'Explores frameworks and methodologies for formulating and implementing business strategies, analyzing competitive environments, and making strategic decisions.', 'Graduate'),
('BU6150', 'Financial Accounting and Reporting', 'BUS', 6, 'Covers advanced topics in financial accounting, including reporting standards, analysis of financial statements, and the interpretation of financial data for decision-making.', 'Graduate'),
('BU6200', 'Marketing Management', 'BUS', 6, 'Examines marketing strategies, consumer behavior, branding, market research methodologies, and the development of marketing plans and campaigns.', 'Graduate'),
('BU6250', 'Operations Management', 'BUS', 6, 'Focuses on managing processes, supply chains, quality control, and optimization of operations to improve efficiency and meet business objectives.', 'Graduate'),
('BU6300', 'Business Analytics and Data Mining', 'BUS', 6, 'Explores techniques for analyzing large datasets, data visualization, predictive modeling, and using data-driven insights for business decision-making.', 'Graduate'),
('BU6350', 'Corporate Finance', 'BUS', 6, 'Covers financial decision-making in corporations, including capital budgeting, risk management, valuation, and capital structure optimization.', 'Graduate'),
('BU6400', 'Entrepreneurship and Innovation', 'BUS', 6, 'Explores the processes involved in starting and managing new ventures, including opportunity recognition, business model development, and fostering innovation.', 'Graduate'),
('BU6450', 'Human Resource Management', 'BUS', 6, 'Examines HR strategies, talent acquisition, performance management, employee development, and organizational behavior in managing human capital.', 'Graduate'),
('BU6500', 'Global Business and International Management', 'BUS', 6, 'Focuses on managing businesses in a global context, addressing cross-cultural management, international trade, and global strategy.', 'Graduate'),
('BU6550', 'Business Ethics and Corporate Social Responsibility', 'BUS', 6, 'Explores ethical dilemmas in business, corporate governance, sustainability, and the role of businesses in society.', 'Graduate'),
('CP2120', 'Principles of Chemistry I', 'CHE', 2, 'Introduction to the origins and principles of modern chemistry. Discussion of atomic and molecular structure, stoichiometry, periodicity, bonding and states of matter. Principles are illustrated through demonstrations and study of descriptive chemistry.', 'Undergraduate'),
('CP2121', 'Principles of Chemistry I Lab', 'CHE', 1, 'Laboratory course designed to illustrate concepts of Principles of Chemistry I. Emphasis on basic chemical concepts, quantitative laboratory skills, descriptive chemistry, and development of scientific report writing skills. Three laboratory hours per week.', 'Undergraduate'),
('CP2130', 'Principles of Chemistry II', 'CHE', 2, 'Continuation of Principles of Chemistry I. Discussion of acid/base and oxidation/reduction reactions, equilibrium, kinetics and electrochemistry. Principles are illustrated through demonstrations and study of descriptive chemistry.', 'Undergraduate'),
('CP2131', 'Principles of Chemistry II Lab', 'CHE', 1, 'Continuation of CP 2121. Emphasis on basic chemical concepts, quantitative laboratory skills, descriptive chemistry, and development of scientific report writing skills. Three laboratory hours per week.', 'Undergraduate'),
('CP3230', 'Mathematical Methods in the Physical Sciences', 'CHE', 3, 'Application of advanced mathematical principles to problems in the physical sciences. Topics include infinite and power series, functions of several variables, matrix and vector algebra, Fourier analysis, special functions and differential equations.', 'Undergraduate'),
('CP3300', 'Organic Chemistry I', 'CHE', 2, 'The first semester of an introductory organic chemistry course. Discussion of major classes of organic compounds, with emphasis on structure, reactions, synthesis, stereochemistry and reaction mechanism.', 'Undergraduate'),
('CP3302', 'Organic Chemistry I Lab', 'CHE', 1, 'Designed to illustrate topics of CP 3300. Stresses development of laboratory skills in synthesis, separation and purification of organic compounds. Emphasizes scientific report writing skills. Four laboratory hours per week.', 'Undergraduate'),
('CP3310', 'Organic Chemistry II', 'CHE', 2, 'Continuation of Organic Chemistry I, with discussion of additional major classes of organic compounds.', 'Undergraduate'),
('CP3312', 'Organic Chemistry II Lab', 'CHE', 1, 'Designed to illustrate topics of CP 3310. Stresses additional synthetic techniques not covered in CP 3302, spectroscopic methods and qualitative organic analysis. Emphasizes scientific report writing skills. Four laboratory hours per week.', 'Undergraduate'),
('CP3400', 'Analytical Chemistry', 'CHE', 3, 'Study of chemical stoichiometry, homogeneous and heterogeneous equilibria, principles of volumetric and gravimetric analysis, chemical separation methods and spectrophotometry. Includes statistical analysis of data and scientific record-keeping. Two lectures and one four-hour laboratory per week.', 'Undergraduate'),
('CP3450', 'Inorganic Chemistry', 'CHE', 3, 'Study of inorganic chemistry emphasizing the use of thermodynamic, kinetic and quantum mechanical principles. Topics include structure, bonding, descriptive chemistry, coordination compounds, group theory, and discussion of current topics from the literature.', 'Undergraduate'),
('CP4320', 'Advanced Organic Chemistry', 'CHE', 3, 'An examination of modern synthetic methods, molecular orbital theory, linear free energy relationships, acidâ€‘base catalysis, neighboring group participation, medium and salt effects, and a detailed consideration of the mechanistic features of a wide variety of organic reactions.', 'Undergraduate'),
('CP4490', 'Biochemistry for Life Sciences', 'CHE', 3, 'One semester survey course designed for life science majors requiring only one semester of biochemistry. We will cover basic concepts about pH, biological buffers, bioenergetics, nucleotides, amino acids, proteins, enzymes, carbohydrates, lipids, intermediary metabolism, and molecular biology.', 'Undergraduate'),
('CP4510', 'Biochemistry I', 'CHE', 3, 'Comprehensive coverage of the chemistry and metabolism of biological compounds, including proteins, nucleic acids, lipids, polysaccharides, and their precursors. Also treats enzyme kinetics, bioenergetics and biosynthesis of important biomolecules.', 'Undergraduate'),
('CP4515', 'Biochemistry II', 'CHE', 2, 'Continuation of Biochemistry I, with emphasis on the control of biochemical processes, photosynthesis, replication, transcription and translation, genetic engineering, ribosomes, and metabolism.', 'Undergraduate'),
('CP4520', 'Biochemistry Lab', 'CHE', 1, 'Laboratory experiments illustrating current biochemical techniques and reinforcing lecture topics. Four laboratory hours per week.', 'Undergraduate'),
('CP4700', 'Physical Chemistry I', 'CHE', 3, 'Survey of the basic principles of physical chemistry, with emphasis on thermodynamics, changes of state, solutions, phase equilibria and kinetic theory.', 'Undergraduate'),
('CP4710', 'Physical Chemistry II', 'CHE', 2, 'Survey of the basic principles of physical chemistry with emphasis on chemical kinetics, quantum mechanics, atomic and molecular structure.', 'Undergraduate'),
('CP4720', 'Physical Chemistry Lab', 'CHE', 1, 'Laboratory experiments designed to illustrate the chemical principles underlying thermodynamics, equilibria, surface and transport properties, chemical kinetics, and spectroscopy. Includes vacuum techniques and use of computers to acquire and analyze data. Emphasizes scientific report writing in standard format.', 'Undergraduate'),
('CP5500', 'Advanced Topics in Chemistry', 'CHE', 3, 'Oneâ€‘semester lecture course covering selected topics of current importance to chemists. Course content may include such topics as spectroscopy, radiation chemistry, electricity and magnetism, molecular orbital theory, group theory and new instrumental techniques.', 'Undergraduate'),
('CP6100', 'Advanced Organic Chemistry', 'CHE', 6, 'Explores advanced topics in organic synthesis, reaction mechanisms, spectroscopy, and structure determination, focusing on modern synthetic methodologies and their applications.', 'Graduate'),
('CP6150', 'Physical Chemistry: Quantum Mechanics', 'CHE', 6, 'Covers advanced quantum theory, molecular structure, spectroscopy, and computational chemistry, providing a deep understanding of the quantum principles governing chemical systems.', 'Graduate'),
('CP6200', 'Inorganic Chemistry', 'CHE', 6, 'Investigates the principles of inorganic compounds, including bonding theories, coordination chemistry, organometallics, and applications in catalysis, materials science, and bioinorganic chemistry.', 'Graduate'),
('CP6250', 'Analytical Chemistry: Mass Spectrometry and Chromatography', 'CHE', 6, 'Focuses on advanced techniques in mass spectrometry and chromatography, emphasizing instrumentation, data analysis, and applications in analytical chemistry and biochemistry.', 'Graduate'),
('CP6300', 'Chemical Kinetics and Reaction Dynamics', 'CHE', 6, 'Explores the rates and mechanisms of chemical reactions, reaction dynamics, molecular collisions, and transition state theory, essential for understanding chemical kinetics at a molecular level.', 'Graduate'),
('CP6350', 'Biochemistry and Molecular Biology', 'CHE', 6, 'Covers the structure and function of biological molecules, enzymatic mechanisms, gene expression, and cellular signaling, integrating principles from chemistry and biology.', 'Graduate'),
('CP6400', 'Materials Chemistry', 'CHE', 6, 'Investigates the synthesis, characterization, and properties of advanced materials, including polymers, nanomaterials, and supramolecular systems, with applications in technology and industry.', 'Graduate'),
('CP6450', 'Environmental Chemistry', 'CHE', 6, 'Explores the fate, transport, and transformations of chemicals in the environment, addressing pollution, sustainability, and the impact of chemical substances on ecosystems and human health.', 'Graduate'),
('CP6500', 'Spectroscopic Methods in Chemistry', 'CHE', 6, 'Focuses on advanced spectroscopic techniques such as NMR spectroscopy, infrared spectroscopy, and optical spectroscopy, emphasizing their applications in chemical analysis and structure determination.', 'Graduate'),
('CP6550', 'Chemical Biology', 'CHE', 6, 'Integrates chemical principles with biological systems, exploring topics such as drug design, molecular imaging, chemical genetics, and the chemical basis of biological processes.', 'Graduate'),
('CS1099', 'Cloud Computing', 'CIS', 4, 'Discusses various cloud computing platforms and there use', 'Undergraduate'),
('CS2510', 'Computer Programming 1', 'CIS', 3, 'This introductory course covers the fundamentals of computer programming, teaching students the basics of a programming language, problem-solving, and algorithm development.', 'Undergraduate'),
('CS2511', 'Computer Programming 2', 'CIS', 3, 'Building on the foundation from Computer Programming 1, this course delves deeper into programming concepts, data structures, and problem-solving techniques, allowing students to develop more complex software applications.', 'Undergraduate'),
('CS2512', 'Computer Architecture', 'CIS', 3, 'This course explores the inner workings of computer systems, focusing on the design and organization of computer hardware components such as the CPU, memory, and input/output devices.', 'Undergraduate'),
('CS2513', 'Data Structures and Algorithms', 'CIS', 3, 'Students learn about various data structures (e.g., arrays, linked lists, trees) and algorithms for efficient data manipulation and problem-solving, a crucial topic in computer science and software development.', 'Undergraduate'),
('CS2514', 'Java and Object-Oriented Progamming', 'CIS', 3, 'This class teaches Java programming and the principles of object-oriented programming, emphasizing the creation of reusable and maintainable software using Java.', 'Undergraduate'),
('CS3211', 'Cybersecurity and Ethical Hacking', 'CIS', 3, 'This class is designed to equip students with the skills and knowledge needed to protect computer systems and networks from cyber threats. It covers topics such as network security, encryption, penetration testing, and ethical hacking. Students have the opportunity to simulate real-world cyberattacks and develop defense strategies to secure digital assets.', 'Undergraduate'),
('CS3420', 'Artificial Intelligence and Machine Learning:', 'CIS', 3, 'In this advanced course, students delve into the exciting world of artificial intelligence and machine learning. They learn about the theory and practical application of AI and ML algorithms, including neural networks, deep learning, natural language processing, and reinforcement learning. Students work on hands-on projects, creating AI-driven applications and gaining a deep understanding of AI\'s impact on various industries.', 'Undergraduate'),
('CS3611', 'Advanced C#', 'CIS', 3, 'Building on the basics of the C# programming language, this course explores advanced topics and techniques for C# software development.', 'Undergraduate'),
('CS3911', 'C++', 'CIS', 3, 'This course focuses on the C++ programming language, covering advanced C++ features, object-oriented programming, and software development with C++.', 'Undergraduate'),
('CS4501', 'Software Engineering', 'CIS', 3, 'Students study the principles and practices of software development, including software design, project management, and quality assurance.', 'Undergraduate'),
('CS4550', 'Database Management Systems', 'CIS', 3, 'This class covers the theory and implementation of database systems, including data modeling, SQL, and database management best practices.', 'Undergraduate'),
('CS5123', 'Natural Language Processing and Text Mining', 'CIS', 3, 'This course explores techniques for understanding and processing human language, covering topics like sentiment analysis, named entity recognition, and text summarization.', 'Undergraduate'),
('CS5198', 'Quantum Computing and Quantum Algorithms', 'CIS', 3, 'This course introduces quantum computing principles and quantum algorithms, exploring the potential of quantum computing in solving computationally challenging problems.', 'Undergraduate'),
('CS5226', 'Computer Graphics and 3D Game Development', 'CIS', 3, 'This course covers the principles of computer graphics, real-time rendering, and 3D game development, with a focus on creating interactive gaming experiences.', 'Undergraduate'),
('CS5329', 'Artificial Intelligence Ethics and Policy', 'CIS', 3, 'Students examine ethical and policy considerations in the field of artificial intelligence, addressing issues like bias, privacy, and responsible AI development.', 'Undergraduate'),
('CS5490', 'Parallel and Distributed Computing', 'CIS', 3, 'Students learn to design and implement parallel and distributed systems, including multi-core processors, clusters, and grid computing.', 'Undergraduate'),
('CS5498', 'Advanced Data Structures and Algorithms', 'CIS', 3, 'Building on fundamental concepts, this course covers advanced data structures and algorithms for optimizing resource usage and solving complex computational problems.', 'Undergraduate'),
('CS5577', 'Advanced Compiler Design and Optimization', 'CIS', 3, 'This course covers advanced compiler construction techniques, code optimization, and the transformation of high-level programming languages into efficient machine code.', 'Undergraduate'),
('CS5689', 'Advanced Machine Learning and Deep Neural Networks', 'CIS', 3, 'This course delves into advanced topics in machine learning, focusing on deep neural networks, reinforcement learning, and their applications in complex problem-solving.', 'Undergraduate'),
('CS5690', 'Software Development in Agile Environments', 'CIS', 3, 'This course focuses on agile methodologies for software development, emphasizing iterative, customer-focused development and collaboration within cross-functional teams.', 'Undergraduate'),
('CS5695', 'Big Data Analytics and Distributed Systems', 'CIS', 3, 'Students learn to process and analyze large-scale datasets using distributed computing frameworks, with a focus on data storage, processing, and real-time analytics.', 'Undergraduate'),
('CS5771', 'Distributed Databases and NoSQL Systems', 'CIS', 3, 'Students study distributed database management systems, including NoSQL databases, data replication, and sharding for scalable and fault-tolerant data storage.', 'Undergraduate'),
('CS5910', 'System Design & Implementation', 'CIS', 3, 'This course teaches the process of designing and implementing complex software systems, emphasizing problem analysis, design patterns, and project execution.', 'Undergraduate'),
('CS5987', 'Cloud Computing and Virtualization', 'CIS', 3, 'Students study cloud infrastructure, services, and virtualization technologies, gaining hands-on experience in deploying and managing cloud-based systems.', 'Undergraduate'),
('CS6100', 'Cloud Security and Compliance', 'CIS', 6, 'Explore security practices, compliance requirements, and risk management strategies in cloud computing environments. Learn to protect data and applications in the cloud.', 'Graduate'),
('CS6150', 'Enterprise Resource Planning (ERP) Systems', 'CIS', 6, 'Study the design, implementation, and management of ERP systems in organizations. Focus on integrating business processes, optimizing operations, and achieving efficiency.', 'Graduate'),
('CS6200', 'Advanced Data Mining and Analytics', 'CIS', 6, 'Dive deep into advanced data mining techniques, predictive analytics, and machine learning algorithms for extracting valuable insights from large datasets.', 'Graduate'),
('CS6250', 'Human-Centered Design and Usability Testing', 'CIS', 6, 'Learn principles of user-centered design and conduct usability testing to create user-friendly software and interfaces. Emphasize user experience and interface design best practices.', 'Graduate'),
('CS6300', 'Digital Forensics and Incident Response', 'CIS', 6, 'Develop skills in investigating cybercrimes, analyzing digital evidence, and responding to security incidents. Understand the legal and ethical aspects of digital forensics.', 'Graduate'),
('CS6350', 'Advanced Mobile App Development', 'CIS', 6, 'Explore advanced topics in mobile app development, including cross-platform development, mobile UI/UX design, and performance optimization for iOS and Android platforms.', 'Graduate'),
('CS6400', 'Cloud-native Application Development', 'CIS', 6, 'Learn how to design, develop, and deploy cloud-native applications that leverage microservices architecture, containerization, and serverless computing for scalability and efficiency.', 'Graduate'),
('CS6450', 'Advanced Software Testing and Quality Assurance', 'CIS', 6, 'Dive into advanced software testing methodologies, test automation, and quality assurance techniques to ensure the reliability and robustness of software applications.', 'Graduate'),
('CS6500', 'Enterprise Architecture and IT Governance', 'CIS', 6, 'Explore the principles of enterprise architecture and IT governance to align IT strategies with business goals. Focus on creating a structured and efficient IT environment.', 'Graduate'),
('CS6550', 'Cybersecurity Incident Handling and Response', 'CIS', 6, 'Develop skills in identifying, mitigating, and responding to cybersecurity incidents. Explore incident response plans, threat hunting, and incident handling best practices.', 'Graduate'),
('CS9000', 'Cloud Computing 12', 'CIS', 4, 'booo', 'Undergraduate'),
('EL1000', 'English Composition I: Exposition', 'ENG', 3, 'Designed to develop and refine studentsâ€™ ability to read, write and think critically. Selected essays will be read and studied as models of rhetorical style, enabling students to detect for themselves the effective use of language and to develop an appreciation for masterpieces of non fiction prose. Students will learn to develop the extended essay with particular attention to discovery and organization. Oral communication skills will be sharpened by directed discussion and by presentation and criticism of class papers. A grade of C or above is required to pass this course.', 'Undergraduate'),
('EL1010', 'Writing Workshop', 'ENG', 3, 'This course will provide students in English Composition with additional writing support. Students in this course will meet for an additional one hour and 30 minutes per week. During this time students will practice effective writing and reading strategies and engage in one-on-one tutoring sessions with their instructor.', 'Undergraduate'),
('EL2001', 'Public Speaking', 'ENG', 3, 'Designed to give the student the poise and confidence necessary to think and speak freely before an audience. This course proceeds from audience analysis through motivation, supporting materials, organization, and delivery.', 'Undergraduate'),
('EL2206', 'Science Fiction Literature', 'ENG', 3, 'Science fiction literature and film are often used to imagine utopian and dystopian worlds. At its best, the genre of science fiction raises questions about what makes a good society, the nature of being human, the role of the outsider, the challenges technological advances present, and gender and sexual norms. The course will examine fiction by authors such as George Orwell, Harlan Ellison, Samuel Delaney, Ursula LeGuin, Philip K. Dick, and Octavia Butler as well as films such as Blade Runner and The Matrix. Students will develop their ability to read and think critically and to write summaries, critical analyses and a research paper based on the course material. The course stresses training in quotation, citation, and research methods.', 'Undergraduate'),
('EL2310', 'Introduction to Literature', 'ENG', 3, 'This course is aimed at developing studentsâ€™ personal responses to literature. The focus will be on specific literary genres such as poetry, drama, novel, short story, and non fiction prose. The readings will cover a variety of periods and cultures.', 'Undergraduate'),
('EL3100', 'Structure and Grammar of English', 'ENG', 3, 'This course places formal English grammar in the context of the structure and development of the language. Devoting significant attention to the evolution of English and its overall structure, the course also offers intensive study of standard grammar, aimed at both Literature and Teaching students. Students study parts of speech, parts of the sentence, verb and pronoun forms and agreement, and the uses of phrases and clauses within sentences, and they learn to identify these in their writing and the writings of others.', 'Undergraduate'),
('EL3500', 'Literature Across Cultures I: Analysis & Interpretation', 'ENG', 3, 'This course explores representative works of U.S. and international literature that find their roots in the worldâ€™s multiplicity of cultures. The course emphasizes multiple strands and traditions both within world literary culture and within the literary cultures of the United States and other nations. Readings and discussions focus on the dominant themes in fiction, poetry, drama, and essays by writers of distinct national and ethnic identities, genders, and sexual orientations. The course also includes studies of writings about multicultural contributions to literature.', 'Undergraduate'),
('EL3510', 'Literature Across Cultures II: Theory', 'ENG', 3, 'This course encourages diverse responses to important works of British-U.S. and World Literature. It fosters the skills of close reading and develops the confidence necessary for independent interpretation of literary texts. While studying each text, students read critical articles about them reflecting the approaches of â€œnew criticism,â€ biographical and psychoanalytic criticism, new historicism, feminism, queer theory, and other current methodologies. Small group discussions of study questions, oral reports, and writing assignments encourage students to read the texts specifically and respond to them independently.', 'Undergraduate'),
('EL3560', 'Literatures of Europe Part I', 'ENG', 3, 'Covers the literary traditions of Europe from the Jewish-Christian Bible to the Renaissance. Works in these traditions have been foundational for most later writing in English, and for much modern World Literature. Selections vary by semester and have recently included works by Homer, Sophocles, Virgil, Dante, Milton, Shakespeare, and others.', 'Undergraduate'),
('EL3561', 'Literatures of Europe Part II', 'ENG', 3, 'Surveys the literary traditions of Europe and its diaspora from the 17th to the 21st centuries. Works in these traditions have inspired modern U.S. and British as well as World Literature. Selections vary by semester; recently the course has included works by Moliere, Voltaire, Dostoevsky, Ibsen, Kafka, Pirandello, Becket, Borges, Camus, and others.', 'Undergraduate'),
('EL3600', 'U.S. Literature I: Colonial to Civil War', 'ENG', 3, 'Poetry, fiction, essay, and memoir from the colonial period to the U.S. Civil War. Examines significant works representative of Puritanism, the Enlightenment, Romanticism, the â€œAmerican Renaissance,â€ Transcendentalism, the voices of Native Americans and women, and the literature of Abolitionism as examples of a developing literary nationalism and as expressions of a multicultural societyâ€™s development and struggles. Authors may include William Bradford, Anne Bradstreet, Benjamin Franklin, Phillis Wheatley, James Fenimore Cooper, Richard Allen, Edgar Allen Poe, Nathaniel Hawthorne, Herman Melville, Ralph Waldo Emerson, Frances E. W. Harper, Frederick Douglass, John G. Whittier, Walt Whitman, William Wells Brown, and others.', 'Undergraduate'),
('EL3610', 'U.S. Literature II: Civil War to Present', 'ENG', 3, 'Poetry, fiction, drama, essay, and memoir from the U.S. Civil War to the present. Examines significant works representing realism, naturalism, modernism, and postmodernism in literary technique and responding to the evolution and tensions of a multicultural society, including the labor, immigration, civil rights, feminist, and lesbian-gay experiences. Authors may include Mark Twain, Emily Dickinson, Henry James, Charles Chesnutt, W.E.B. Du Bois, Sui Sin Far, Willa Cather, Edith Wharton, Langston Hughes, Zora Neale Hurston, Ernest Hemingway, William Faulkner, Richard Wright, Tennessee Williams, Ralph Ellison, Gary Soto, August Wilson, Oscar Hijuelos, Louise Erdrich, Toni Morrison, Audre Lorde, Thom Gunn, and others.', 'Undergraduate'),
('EL3865', 'Literature of Asia', 'ENG', 3, 'This course focuses on the reading and discussion of a number of literary masterpieces, both traditional and contemporary, drawn from the cultures of China, Japan, and India. The range of works presented will provide foundation for considering the influence of history and religion on literature, as well as the ways in which literature shapes culture.', 'Undergraduate'),
('EL4060', 'Literature of Class & Class Consciousness', 'ENG', 3, 'Class represents a largely unacknowledged â€œcultureâ€ coexisting and interacting with others such as ethnic cultures, womenâ€™s experience, and lesbian/gay culture. This course looks at fiction, poetry, and drama about class and class conflict, primarily by writers from working-class backgrounds. Examining class and class consciousness, and the interaction of class and race in the U.S., we will explore how literature has been a medium for members of oppressed groups to voice their experiences, world views, and demands, and also for members of more privileged groups to respond to social change.', 'Undergraduate'),
('EL4311', 'Greek Drama', 'ENG', 3, 'The art of drama is one of the legacies of Greece to Western culture. In this course, the development of Greek tragedy and comedy is discussed; plays by Aeschylus, Sophocles, Euripides, and Aristophanes are read as well as 20th century dramas based on these 5th century works. Some attention is also given to the criticism of Greek tragedy by Plato and Aristotle.', 'Undergraduate'),
('EL4325', 'Shakespeare: Selected Plays', 'ENG', 3, 'Selected plays by Shakespeare will be read and examined critically and analytically through discussion of these works and of the historical context of the Elizabethan theater and world view. The focus will also be on the richness and variety of Shakespearean language and thought. Study includes close reading of some well-known Shakespearean tragedies and comedies as well as viewing of plays on film.', 'Undergraduate'),
('EL4630', 'Latin American Literature', 'ENG', 3, 'Taught in English. This course is a survey of Latin American literature since the conquest. The class will first read and discuss descriptions of the Americas as seen by the first European conquerors as well as pre-Colombian texts written by native Americans. We will then read representative works of various literary periods from baroque poems to â€œmagical-realistâ€ novels. We will analyze such themes as the collision of cultures, â€œcivilization and barbarityâ€, the African influence on Latin American letters and the making of a Latin American identity.', 'Undergraduate'),
('EL4800', 'Major Authors', 'ENG', 3, 'This course examines the development of one or more authors, tracing key themes, influences, shifts and continuities, and aesthetic development in the context of cultural and political forces. Authors are selected on the basis of having made landmark contributions to the continuing development of literature. Recent offerings have included James Baldwin, William Blake, Ralph Ellison, William Faulkner, F. Scott Fitzgerald, Toni Morrison, Mary Shelley, Mary Wollstonecraft, and Virginia Woolf, and others may be selected in the future.', 'Undergraduate'),
('EL5000', 'Senior Seminar- Research & Writing', 'ENG', 3, 'Autobiographical and biographical works focusing on intellectual development aid students in understanding issues of personal and career identity, the impact of literary study on the formation of self, and related topics. Classwork stresses research and documentation skills and participation in a seminar setting in which each student presents some independent research to the class. In preparation for the senior thesis, students compose their own intellectual autobiographies tracing their growth and development as English majors. Students must complete a senior thesis proposal to pass the course.', 'Undergraduate'),
('EL5010', 'Senior Seminar- Thesis', 'ENG', 3, 'Under supervision of seminar director, students complete the senior thesis from sequential, critiqued drafts to finished manuscript. Students work intensively with a Thesis Director. Seminar sessions continue development of research and writing skills stressing the integration of research within the studentâ€™s own analysis and presentation. Sessions include collaborative readings of work in progress, peer review, oral reports, and presentation of senior thesis.', 'Undergraduate'),
('EL6100', 'Modern and Contemporary American Poetry', 'ENG', 6, 'Explore the evolution of American poetry from the late 19th century to the present day, focusing on major poets and movements.', 'Graduate'),
('EL6150', 'British Literature: Romanticism to Present', 'ENG', 6, 'Study British literature from the Romantic period to the contemporary era, examining key literary works and cultural contexts.', 'Graduate'),
('EL6200', 'African Literature and Postcolonialism', 'ENG', 6, 'Examine literature from various African regions and its relationship with postcolonialism, identity, and cultural expression.', 'Graduate'),
('EL6250', 'Creative Writing Workshop', 'ENG', 6, 'Develop your creative writing skills through workshops and peer feedback, focusing on different genres such as fiction and poetry.', 'Graduate'),
('EL6300', 'Literature and Film', 'ENG', 6, 'Analyze the adaptation of literary works into film, exploring the intersections of storytelling in both mediums.', 'Graduate'),
('EL6350', 'Gender and Sexuality in Literature', 'ENG', 6, 'Investigate the representation and exploration of gender and sexuality in literature, considering feminist and LGBTQ+ perspectives.', 'Graduate'),
('EL6400', 'World Mythology and Literature', 'ENG', 6, 'Explore the rich world of mythology and its influence on literature from various cultures and time periods.', 'Graduate'),
('EL6450', 'Literary Criticism and Theory', 'ENG', 6, 'Delve into literary criticism and theory, studying various approaches and critical perspectives used in the analysis of literature.', 'Graduate'),
('EL6500', 'Environmental Literature', 'ENG', 6, 'Examine literature that addresses environmental issues, eco-criticism, and the relationship between nature and culture.', 'Graduate'),
('EL6550', 'Postmodern Literature and Theory', 'ENG', 6, 'Study postmodern literature and its theoretical underpinnings, exploring postmodern themes, narrative techniques, and aesthetics.', 'Graduate'),
('HI1010', 'World Religions - West', 'PHI', 3, 'This course provides an introduction to the three major religions that share a common belief in the God of Abraham: Judaism, Christianity, and Islam. We will look at the history, beliefs, and practices of each religion separately, but also at the ways they have interacted. These interactions-sometimes peaceful and creative; sometimes violent- have been a major shaping force in Western civilization, from the development and transmission of Greek philosophy through the Crusades, the Holocaust and the ongoing definition of â€œWestern values.â€ Study of Judaism, Christianity, and Islam leads to a deepened understanding of principles of theology and ethics, as well as current issues in religious and community life.', 'Undergraduate'),
('HI1020', 'World Religions - East', 'PHI', 3, 'It is often said that what is needed in modern life is more â€œspiritualityâ€-a balance of inward and outward awareness that is often associated with eastern religions. But what do these traditions really mean for people who practice them? This course provides an introduction to the major belief systems and practices of eastern and southern Asia: Hinduism, Buddhism, Confucianism, Taoism, and Shintoism. We will look at the evolution of each of these religions, considering the ways they have inspired individuals and shaped civilizations through cosmology, ritual, literature and art. We will also look at the ways that these traditions influence societies, including our own, that are far from the religionsâ€™ places of origin.', 'Undergraduate'),
('HI2155', 'Introduction to Comparative Religion', 'PHI', 3, 'Considers the nature and origin of religion, elements of religious practice and thought (symbol, myth, the sacred), ways of being religious, and religion as a basis of community. Methods of analysis include ethical, psychological, sociological, historical, and theological.', 'Undergraduate'),
('HI2200', 'Science in Western Civilization', 'HIS', 3, 'A broad, introductory survey of the development of scientific ideas in the West from ancient times to the 20th century, with an emphasis on the major figures and ideas, and key turning points. The course will present selective social and intellectual contexts of science as well as the role of science in shaping Western thought.', 'Undergraduate'),
('HI2681', 'Introduction to European History', 'HIS', 3, 'A systematic survey of European political, social, economic, cultural and intellectual history since the Renaissance. The course provides the student with the story of the origins, the pre-conditions, and the continuity of the â€œmakingâ€ of the new Europe up to the present. Topics include the age of discovery, nation building, despotism, romanticism, nationalism, science and technology, ideologies and revolutions. An excellent basis for the further study of European history in upper-division courses.', 'Undergraduate'),
('HI2700', 'Introduction to Logic', 'PHI', 3, 'This course is designed to sharpen the studentâ€™s analytical abilities and powers of reasoning and argumentation. Topics will include types of argument, the structure of argument, how to recognize arguments that are emotionally persuasive but logically fallacious, and the fundamentals of modern, symbolic logic which is the basis for computer languages. The course will stress the practical value of the principles taught and will relate class work to communication skills in general.', 'Undergraduate'),
('HI2720', 'Introduction to Philosophy', 'PHI', 3, 'Serves as an introduction to the role of philosophy in human life. Philosophy will be examined in terms of both its analytical and speculative functions. Of concern will be the relation of philosophical insights to certain compelling contemporary issues. Some of the issues discussed will be the nature of knowledge and truth, the relation of values (both moral and aesthetic) to society, free will, and justice and society. Readings will be drawn from classical and contemporary philosophers.', 'Undergraduate'),
('HI2810', 'Geography, Earth, and People', 'HIS', 3, 'Geography sits at the interface between people and their physical world. This course explores this interface by looking at three key elements of the discipline: Mapping, Physical Geography and Socio-Cultural Geography. In the first half of the course, students learn basic concepts and methods to read and make maps and explore the forces making landforms and landscape. In the second half, students make use of these skills and concepts to explore the diversity of human interactions with the physical world. Using the concept of â€œregion,â€ students are introduced to social and physical factors defining world regions as well as the connections that bind these regions together.', 'Undergraduate'),
('HI3002', 'Rise of Reason', 'HIS', 3, 'An introduction to the Greek and Roman origins of Western civilization. This course aims, through a critical study of the works of the greatest minds and literary artists of Greece and Rome, to give an understanding of their contributions to western culture, to provoke thinking on basic problems of human experience, to develop literary taste and judgment, and to improve skills in oral discussion and written analysis. Readings are drawn from the following major genres: epic, tragedy, history and philosophy.', 'Undergraduate'),
('HI3011', 'Foundations of the Judeo-Christian Tradition', 'PHI', 3, 'Western civilization is often characterized as the dynamic interplay of two cultural traditions referred to in convenient shorthand as “Athens and Jerusalem.” This course will examine “Jerusalem”: the text, figures, themes, and ideas that have defined the Judeo-Christian tradition. The course will emphasize the reading of the Biblical text itself beginning with Genesis and ending with selections from the Pauline tradition.', 'Undergraduate'),
('HI3021', 'Europe in the Middle Ages', 'HIS', 3, 'Western values and institutions were formed in the medieval synthesis of Greek philosophy, Roman law, Hebrew/ Christian religion, and Germanic folk culture. This course explores the cultural products of that synthesis in art, literature, and religion, and examines the roots of western attitudes toward race, class, nationalism, and war. Taught as social history, it emphasizes the economic and political context in which the cultural foundations of the modern West were forged.', 'Undergraduate'),
('HI3030', 'From God to the Machine: Europe from the Sixteenth to the Eighteenth', 'HIS', 3, 'The course will conduct a broad-based examination of the development of the modern mechanistic world-view. Topics will include the Scientific Revolution and Enlightenment, the series of political revolutions that moved Europe from Divine-Right Monarchy to Constitutional Democracy, and the socioeconomic transformations wrought by the Industrial Revolution that moved the mass of Europeans from an animate natural environment to a mechanistic urban milieu, creating the conditions in which reason replaced faith as the common sense of the common man.', 'Undergraduate'),
('HI3040', 'Analysis of Culture', 'PHI', 3, 'Exploration of the role of culture in shaping human action and experience. Various approaches to the explanation of culture are considered in the context of the development of social science. Students learn to interpret their own culture and other cultures as systems of knowledge and value. Especially important are the ways culture conditions the effects of social forces in daily life.', 'Undergraduate'),
('HI3080', 'Asian Cultures', 'HIS', 3, 'An introduction to the historical and cultural traditions of India, China and Japan. This course invites students to explore the major traditions, ideas, values and social systems that shaped the lives of the peoples of these three Asian countries in the past and that continue to do so today. Students are encouraged to explore their reactions to these unfamiliar ways of life while, at the same time, gaining the ability to view each civilization and culture from its own perspective.', 'Undergraduate'),
('HI3091', 'African Cultures', 'HIS', 3, 'An exploration of African civilization, concentrating on the systems of ideas, values, and institutions developed by Subâ€‘Saharan peoples in the context of their historical experience. The unity and diversity of African cultures are related to the economic, political, and social forces operating upon them in relation to the contemporary search for African selfâ€‘determination.', 'Undergraduate'),
('HI3102', 'Hispanic Heritage', 'HIS', 3, 'Taught in English. The Moorish (Muslim) invasion of the Iberian Peninsula in 711 AD, together with the growing presence of Jewish culture and religion in the Iberian Peninsula (Spain and Portugal), transformed the history and culture of the region in ways that are still visible today. Spainâ€™s world-view, religion, artistic and intellectual expression, architecture, and most importantly its language, are a result of that cross-cultural evolution that started more than twelve centuries ago. This course will explore the pivotal role played by Spain in modern European history and culture. Topics, such as the Counter Reformation, the Inquisition, the â€œGolden Age,â€ the â€œmerging of culturesâ€ as a result of Spainâ€™s conquest of the New World, and modern Imperialism will be studied and analyzed as part of the Western tradition.', 'Undergraduate'),
('HI3110', 'Latin American Culture', 'HIS', 3, 'This history of the Latin American countries is studied from its origins through today. Topics explored include the Amerindian cultures, European conquest and colonialism, African slavery, revolution and independence, â€œcaudillismoâ€ and dictatorships. These topics will be studied through the use of maps, films and literature.', 'Undergraduate'),
('HI3200', 'Contemporary Religious Experience', 'PHI', 3, 'This course introduces students to the major forms of religious worship and practice in the world today. Videos and field trips as well as readings will be used to develop insights into the distinctive features of worship in various branches of well-defined world religions-Christianity, Islam, Hinduism, and Buddhism-as well as less known or less defined paths such as Sikhism, Rastafarianism, and traditional Caribbean and North American traditions. In addition to exploring distinctions and influences, we will consider the nature of worshippersâ€™ experiences of their faiths. At least one semester of academic study of religion is recommended as a prerequisite for this course.', 'Undergraduate'),
('HI3323', 'Buddhism', 'PHI', 3, 'This course offers an introduction to the historical, socio-cultural, and philosophical dimensions of Buddhism. It begins with the founding of the religion in India by Gautama Buddha and proceeds to trace its many philosophical trajectories and its multi-cultural history extending throughout Southern and Eastern Asia and beyond. The second half of the semester focuses on the Mahayana Buddhist tradition as a case study in the â€œattaining of enlightenmentâ€ by ordinary individuals, analyzing how this tradition has been shaped by historical and cultural forces as well as how it may apply to contemporary issues in our increasingly globalized world.', 'Undergraduate'),
('HI3525', 'Ancient Greek Philosophy', 'PHI', 3, 'An historical introduction to the foundations of Western thought in Ancient Greece and Alexandria. The course focuses on the philosophies of the pre-Socratics, Plato, Aristotle, the Stoics, the Epicureans, and the Neoplatonists. Readings include short selections from the corpus of the Platonic dialogues, Aristotle, and Plotinus.', 'Undergraduate'),
('HI3558', 'Classical Greco-Roman History', 'HIS', 3, 'This course will develop an appreciation and understanding of the history of Classical Greek and Roman civilization. It will survey various aspects of society beginning with the early Minoan and Mycenaean civilization and ending with the fall of the Western Roman Empire. The course goals are for students to learn the historical and cultural framework of Greek and Roman civilizations; to understand the social, ethical and religious setting as well as the philosophical thought of the time; to comprehend geographical locations, the names of prominent people in history and their political and military contributions as these influenced both their times and today; to explore the relationship of Greco-Roman civilization to neighboring civilizations to the east and the peoples to the north; and to apply critical and creative thinking to the study of ancient leaders and extrapolate what can be learned from their life experiences.', 'Undergraduate'),
('HI3600', 'Global Geography', 'HIS', 3, 'This course develops a human geography approach to a diversity of political economic and cultural topics of global importance from an international, cross-cultural and historical perspective. It highlights the roots of contemporary global relationships among places as they influence political and economic trends. A wide and shifting range of topics are covered including, among others, the political economy of the world system, globalization and development, geopolitics, the geography of food and agriculture and urban geography. This course also introduces students to the critical thinking skills necessary for a geographical analysis and to sharpen their global awareness.', 'Undergraduate'),
('HI3640', 'African History', 'PHI', 3, 'Approaches the history of Africa from the viewpoint of African people. Archaeological records, oral tradition and documentary sources bring ancient and medieval Africa to life. Later units will focus on important themes and debates in African history today. Students will come to understand African civilization in the context of who Africans are, the social forces that have shaped their experience, and the new directions and problems they face in the postâ€‘independence era.', 'Undergraduate'),
('HI3700', 'Historical Geography of Latin America', 'HIS', 3, 'This course is an exploration of the construction of Latin America as a geographical region from colonial times to the present. The course focuses on the economic and cultural processes involved in production the region over time. We also look at how the region has historically been divided into sub-regions and specific countries, placing an emphasis on the political economic forces underlying these division. In addition, the course pays particular attention to the cultural production of Latin American sub-regions with an emphasis on the history of various racial groups in different parts of the region.', 'Undergraduate'),
('HI3703', 'Modern Philosophy', 'PHI', 3, 'This course will examine some of the major philosophers of the modern period. Readings will be drawn from thinkers including Descartes, Hume, Kant, Hegel, Marx, Kierkegaard, Nietzsche. The course will conclude with selected topics and issues in 20th Century thought.', 'Undergraduate'),
('HI3704', 'African Religions and Philosophy', 'PHI', 3, 'The view of the African cosmology and religion as a system of thought. Principles of what constitutes African philosophy and religion will be examined to analyze the effects on society and politics. The study includes animism, Christianity and Islam.', 'Undergraduate'),
('HI3710', 'Contemporary Philosophical Issues', 'PHI', 3, 'This course provides a focused analysis of philosophical questions central to contemporary social and political debate. Topics will be drawn from such current issues as war and peace, terrorism and just war theory, human rights, the philosophy of race and gender, the philosophy of law, the nature of social justice, and biomedical and professional ethics.', 'Undergraduate'),
('HI3835', 'Islamic Cultures', 'HIS', 3, 'This course provides an introduction to the history of Muslim people and societies, and the belief system of Islam. Beginning with the socio-economic background of pre-Islamic Arabia, we will explore the radically transforming message of the Quran and the empire founded by Muhammad as spiritual and political leader. Students will gain insight into the spread of Islam, as it developed from a regional faith into a force in world civilization in Europe, Africa, the Middle East, and Asia.', 'Undergraduate'),
('HI3840', 'Crescent and Cross: Islam and Christianity in History', 'PHI', 3, 'This course provides an introduction to the roles that Islam and Christianity have played in the history and social structures of the Middle East and Europe. After presentation of the origins and essential principles of both faiths, we will explore the interactions of the faith communities across geographic and ideological boundaries, concluding with consideration of how Muslim/ Christian dialogue and conflict shape our world today.', 'Undergraduate'),
('HI3950', 'Philosophy of Religion', 'PHI', 3, 'The course is an examination of religion and the logic of religious discourse. It explores formal, philosophical, and mystical types of theologies; epistemological ethics of revelation, sin, guilt, faith, and salvation; the concept of and arguments for the existence of God; paradigms of experiential religion, such as the encounter of the human being with the divine in Judaism, the experience of love in Christianity, the surrender as de-alienation in the Islamic Sufi vision, and the dialectics of dynamic interdependence expressed as yin-yang in Daoism. A consideration of psychological accounts of religion, challenges of naturalism, existential atheism, and philosophical analysis.', 'Undergraduate'),
('HI4001', 'Nineteenth Century', 'HIS', 3, 'The impact of European culture and imperialism on the peoples of India and Japan. Literary works of the period are used to highlight the changes reshaping Europe in the early nineteenth century, the encounters between Europeans and Asian peoples which accompanied the expansion of Europe and the attempts of Europeans and Asians to come to terms with these encounters. Readings include Dickensâ€™ Hard Times, stories by Rudyard Kipling and Rabindranath Tagore, Botchan by Natsume Soseki.', 'Undergraduate'),
('HI4011', 'Twentieth Century', 'HIS', 3, 'The mutual impact of cultures throughout the world; the end of nineteenth century colonialism; revolutions and wars; the emergence of the â€œthird world.â€ Study of the interrelationship of European with Asian and African cultures in the twentieth century. Readings include novels from several cultures.', 'Undergraduate'),
('HI4051', 'Logic and Scientific Reasoning', 'PHI', 3, 'An introduction to scientific reasoning, including elementary logic, theory testing and decision-making. A practical course designed to help students read and interpret scientific findings, especially reports that appear in popular magazines and newspapers. More specific topics include probability, causal and statistical hypotheses, correlations, causation and sampling techniques. Although the course offers special benefits to students in the sciences and social sciences, no technical background is assumed.', 'Undergraduate'),
('HI4395', 'Philosophy from the 20th to the 21st Century', 'PHI', 3, 'This course covers highlights of philosophy in the twentieth and twenty first centuries. It begins with Modern European thought (British empiricism, continental rationalism) and its development in the nineteenth century (I. Kant and German Idealism); continues with early and later analytical philosophy; turns thereafter to existentialism, phenomenology, and pragmatism; and culminates in the philosophy of A. N. Whitehead. Readings include key selections from the works of Carnap, Sartre, Dewey, Heidegger, and the later works of Wittgenstein.', 'Undergraduate'),
('HI4557', 'Renaissance and Reformation in Europe', 'PHI', 3, 'The foundations of Modern Europe were laid in the two movements examined in this course. It begins with the revival of pagan classical culture in the commercial and urban milieu of Renaissance Italy, and traces the diffusion of the artistic and intellectual movement pioneered there to the rest of Europe. As Renaissance culture spread, it merged with existing traditions, and thereby contributed to the Reformation, a religious reform movement that transformed the Christian religion and convulsed Europe for more than a century. The course emphasizes the interconnections between Europeâ€™s socio-economic development, its political upheavals, and its dramatic cultural achievements.', 'Undergraduate'),
('HI4800', 'History of India', 'HIS', 3, 'Fat Maharajas atop bejeweled elephants, naked holy men sitting silently along the roadside, ragged children begging for scraps of food, maddened zealots attacking each other from caste hatred or religious fanaticism -these are the stark images that dominate American and Western ideas about India. But Indiaâ€™s 5,000-year history offers much more. From the intricacies of an ancient Sanskrit-based culture and the grandeur of Mughal tombs to the vibrancy of modern Bollywood films and the contending ethnic/religious identities of post Independence India-Indiaâ€™s history tells the story of how diverse populations wove together their different ways of life to create the multi-dimensional tapestry that is India today. This one semester course explores the vibrant diversity of Indiaâ€™s past with an emphasis on its multiple legacies and the ways 20th and 21st century Indians have used these legacies to construct modern identities and a modern, democratic nation.', 'Undergraduate'),
('HI4850', 'Domesticity 19th/20th centuries', 'HIS', 3, 'â€œA place for everything and everything in its place.â€ This trans-regional history course explores the spread of European, middle-class ideas about home and family life-global domesticity-throughout the 19th century world, with special focus on origins in England and development in and impact on America, India and Africa. What relationship should exist between a husband and a wife, how a mother should raise her children, even how kitchen spices should be arranged on a storeroom wall-all became issues for debate and contestation. We look at these debates and conflicts through domestic manuals produced in these countries and through the life stories of people (mostly women) who wrote and/or read these materials.', 'Undergraduate'),
('HI4905', 'Chinese Civilization', 'HIS', 3, 'An introduction to one of the oldest civilizations of the world. This course will provide students with general knowledge of 5,000 years of Chinese history and peoples, cultures and traditions, languages and literatures, music and arts, as well as philosophies and beliefs. It will also introduce students to the impact of cultures on the establishment and development of the Chinese social, political and economic systems.', 'Undergraduate'),
('HI5000', 'Social Studies Senior Seminar', 'HIS', 3, 'This course is the required capping course for History majors completing the Social Studies Track and for Adolescence Education Social Studies majors completing the B.A. in History (Social Studies Track). It focuses on the issue of global human rights. Students define, research, and write a major research paper on some aspect of human rights.', 'Undergraduate'),
('HI5910', 'Senior Research Project', 'PHI', 3, 'A research project required of Philosophy and Religion majors that can be structured in one of the following ways: 1) The student may enroll in HI 5910 at the same time as another upper-division Philosophy and Religion course and do the research project in conjunction with the course; OR 2) The student may enroll in HI 5910 and do the research project as a â€œstand-aloneâ€ undertaking in consultation with an adviser.', 'Undergraduate'),
('HI6100', 'Introduction to Advanced History', 'HIS', 6, 'This course provides the necessary knowledge for students looking to pursue a Graduate or PHD in History', 'Graduate'),
('HI6105', 'Metaphysics and Epistemology', 'PHI', 6, 'Explores fundamental questions about existence, reality, knowledge, and the nature of truth, examining topics such as ontology, theories of truth, and theories of knowledge.', 'Graduate'),
('HI6150', 'Advanced American History', 'HIS', 6, 'Explores the intricate tapestry of American development, delving into socio-political movements, cultural shifts, and the evolution of institutions that have shaped the nation\'s identity and global influence.', 'Graduate'),
('HI6155', 'Ethical Theory and Moral Philosophy', 'PHI', 6, 'Investigates ethical frameworks, moral reasoning, and normative theories of ethics, including virtue ethics, deontology, consequentialism, and applied ethical issues.', 'Graduate'),
('HI6200', 'Advanced Global History', 'HIS', 6, 'Examines the interconnectedness of civilizations, analyzing pivotal moments, cross-cultural exchanges, and the rise and fall of empires to understand the complex evolution of our global community.', 'Graduate'),
('HI6205', 'Philosophy of Mind', 'PHI', 6, 'Studies the nature of consciousness, mental states, the mind-body problem, and theories of perception and cognition, exploring the relationship between the mind and the physical world.', 'Graduate'),
('HI6250', 'Advanced European History', 'HIS', 6, 'Investigates Europe\'s dynamic past, investigating the social, economic, and political forces that have molded the continent\'s history, including wars, revolutions, and transformative ideas.', 'Graduate'),
('HI6255', 'History of Philosophy', 'PHI', 6, 'Surveys major figures and movements in the history of philosophy, spanning ancient, medieval, modern, and contemporary periods, examining key philosophical texts and ideas.', 'Graduate'),
('HI6300', 'History In the Making', 'HIS', 6, 'Engages students with contemporary events, analyzing current geopolitical shifts, social movements, and technological advancements to understand how today\'s actions shape the future historical narrative.', 'Graduate'),
('HI6305', 'Logic and Philosophical Argumentation', 'PHI', 6, 'Covers formal logic, deductive reasoning, informal fallacies, and the principles of critical thinking, providing tools for analyzing and constructing valid arguments.', 'Graduate'),
('HI6350', 'Ancient Historical Studies', 'HIS', 6, 'Surveys the ancient civilizations of the world, exploring their cultural, religious, and technological contributions while analyzing primary sources to reconstruct and interpret their histories.', 'Graduate'),
('HI6355', 'Philosophy of Science', 'PHI', 6, 'Examines the nature of scientific inquiry, theories of explanation, scientific realism, and the relationship between science, theory, and observation.', 'Graduate'),
('HI6400', 'Influence of Politics on History', 'HIS', 6, 'Explores the symbiotic relationship between politics and historical narratives, examining how governance, ideology, and power dynamics have shaped societies and historical trajectories.', 'Graduate'),
('HI6405', 'Political Philosophy', 'PHI', 6, 'Explores theories of justice, political legitimacy, rights, democracy, and governance, engaging with philosophical debates surrounding political institutions and social structures.', 'Graduate'),
('HI6450', 'Influence of Economics on History', 'HIS', 6, 'Investigates the impact of economic systems, trade, and resource allocation on historical developments, elucidating how economic forces have been instrumental in shaping societies.', 'Graduate'),
('HI6455', 'Aesthetics and Philosophy of Art', 'PHI', 6, 'Studies the nature of beauty, aesthetic experience, theories of art, and the philosophical implications of artistic creation and interpretation.', 'Graduate'),
('HI6500', 'Graduate History Seminar', 'HIS', 6, 'Offers an interactive forum for in-depth discussions, research presentations, and critical analysis of historiography, fostering advanced academic discourse among graduate students.', 'Graduate'),
('HI6505', 'Philosophy of Language', 'PHI', 6, 'Explores the nature of language, meaning, semantics, and communication, investigating theories of reference, truth conditions, and linguistic analysis.', 'Graduate'),
('HI6550', 'Graduate History Thesis', 'HIS', 6, 'Guides students through the process of conceiving, researching, and writing an original thesis under faculty supervision, allowing for comprehensive exploration and contribution to historical scholarship.', 'Graduate'),
('HI6555', 'Philosophy of Religion', 'PHI', 6, 'Examines philosophical issues related to religion, including arguments for the existence of God, religious experience, religious language, and the problem of evil.', 'Graduate'),
('MA1010', 'Powertrack Math', 'MAT', 3, 'Powertrack Math is a highly structured course which utilizes an active learning approach. The course involves mandatory attendance at a lecture class and required hours working in a lab. The purpose of the course is to prepare students in an accelerated way for entry into MA 1020 - College Algebra and other courses that meet the Mathematics Proficiency requirement at the College. It will include topics of real number arithmetic as well as topics in Introductory Algebra, including linear equations and inequalities, graphing linear equations, exponents, polynomials and factoring, and systems of equations. Attendance at an orientation meeting prior to the beginning of the semester is mandatory.', 'Undergraduate'),
('MA1020', 'College Algebra', 'MAT', 3, 'Topics include functions, factoring polynomials, rational and algebraic expressions, exponents and radicals, solutions to quadratic equations, inequalities, graphs of functions, exponential and logarithmic functions, solution of exponential and logarithmic equations.', 'Undergraduate'),
('MA2000', 'Applied Statistics', 'MAT', 3, 'Applied Statistics is a Liberal Education Curriculum course intended to develop the statistical literacy of all students regardless of their major. The emphasis is on organizing and summarizing data, applying appropriate statistics, and on understanding and interpreting the results of statistical tests. Real data derived from a variety of fields including education, psychology, sociology, life and physical sciences, economics, and business will be used throughout the course.', 'Undergraduate'),
('MA2010', 'Foundations of Mathematics I', 'MAT', 3, 'A course designed primarily for students majoring in elementary education. MA 2010 covers fundamental theory, historical context and underlying logic of mathematics taught in elementary school. Content is intended to complement the recommendations in the National Council of Teachers of Mathematics Standards, and emphasis is placed on problem solving and communication in mathematics. Topics studied include introductory problem solving, functions, number systems, the operations and properties of arithmetic, estimation, and selected topics from set theory and number theory.', 'Undergraduate'),
('MA2090', 'Precalculus', 'MAT', 3, 'A course designed primarily for students who wish to take MA 2310. A study of algebraic, logarithmic, exponential, and trigonometric functions and their graphs.', 'Undergraduate'),
('MA2310', 'Calculus and Analytic Geometry I', 'MAT', 3, 'Topics include functions and their graphs, limits and continuity, derivatives of polynomials, rational functions, algebraic functions, exponential & logarithmic functions, and trigonometric functions, applications of the derivative, definite and indefinite integrals, fundamental theorem of calculus.', 'Undergraduate'),
('MA2320', 'Calculus and Analytic Geometry II', 'MAT', 3, 'Topics include indefinite and definite integral, applications of definite integral, integration techniques, infinite series, and analytic geometry.', 'Undergraduate'),
('MA2500', 'History of Mathematics', 'MAT', 3, 'A survey of the history of mathematics from the beginnings through the 20th century, with special attention to culture and mathematics. Emphasis on topics germane to the high school curriculum.', 'Undergraduate'),
('MA2701', 'Business Anaytics', 'MAT', 3, 'Business Analytics is a course of data analysis and data mining for managers. We will see number of modern techniques from a higher level viewpoint with the purpose of understanding the application toward decision-making instead of the theoretical foundations. These skills are in-demand and could help one be more competitive in the workplace. The course will cover topics in prediction, classification, and clustering. It also introduces data visualization tools, as well as dimensionality reduction techniques.', 'Undergraduate'),
('MA2702', 'Marketing Analytics', 'MAT', 3, 'Marketing Analytics is a course of data analysis and data mining for marketing purposes. We will see number of modern techniques from a higher level viewpoint with the purpose of understanding the application toward decision-making instead of the theoretical foundations. These skills are in-demand and could help one be more competitive in the workplace. The course will cover topics that could include Pricing, Forecasting, and Market Segmentation. We will use tools such as Excel Solver, Monte Carlo Simulations, Logistic Regression, Trees, Cluster Analysis, and Neural Nets.', 'Undergraduate'),
('MA3020', 'Foundations of Mathematics II', 'MAT', 3, 'A course designed primarily for students majoring in elementary education. MA 2020 covers fundamental theory, historical context and underlying logic of mathematics taught in elementary school. Content is intended to complement the recommendations in the National Council of Teachers of Mathematics Standards, and emphasis is placed on problem solving and communication in mathematics. The syllabus includes topics from elementary combinatorics, probability, statistics, geometry and measurement.', 'Undergraduate'),
('MA3030', 'Discrete Mathematics', 'MAT', 3, 'An introduction to discrete mathematical structures. Topics include propositional and predicate logic, set theory, relations and functions, induction and recursion, methods of proof, number theory, and graphs and trees.', 'Undergraduate'),
('MA3160', 'Linear Algebra', 'MAT', 3, 'An introduction to linear algebra. Topics included systems of linear equations, matrices and matrix algebra, determinants and their properties, vectors and vector spaces, linear independence, span of a set of vectors, basis and dimension of a vector space, linear transformations of vector spaces, rank of a matrix and the rank theorem, eigenvalues and eigenvectors, and diagonalization of matrices.', 'Undergraduate'),
('MA3180', 'Foundations of Secondary School Mathematics', 'MAT', 3, 'This course is designed for students planning to be secondary school mathematics teachers. The course covers the fundamental theory, historical context and underlying logic of mathematics taught in secondary school. It follows the National Council of Teachers of Mathematics Standards. The goal is for students to develop a deep understanding of secondary mathematics and to enable future teachers to provide their students with the highest quality instruction. This course can be used as a preparation for the New York State Teacher Certification Examination in Mathematics, Content Specialty Test.', 'Undergraduate'),
('MA3210', 'Intro. To Probability & Statistics', 'MAT', 3, 'This course provides a foundation in probability and statistical inference. Topics include set operations, combinatorics, games of chance, models for uncertainty, tree diagrams, random variables, discrete and continuous distributions, bayesian analysis, expectation, variance, sampling statistics, estimation, hypothesis testing. Emphasis on reasoning skills, model development and problem solving across disciplines', 'Undergraduate'),
('MA3330', 'Calculus and Analytic Geometry III', 'MAT', 3, 'Three main areas will be studied. The first is the Vector algebra and geometry of three-dimensional space including: lines, planes, and curves in space; polar, cylindrical, and spherical coordinate systems. Using this geometry, limits, partial differentiation, directional derivatives, max-min theory and Lagrange Multipliers are studied. The final area of study is integration, including double, triple integrals, line integrals, and the divergence, Greenâ€™s and Stokes Theorems.', 'Undergraduate'),
('MA3520', 'Transition to Advanced Mathematics', 'MAT', 3, 'An introduction to concepts commonly used in advanced mathematics with an emphasis on writing proofs. Topics include logic, set theory, relations, functions, and cardinality as well as selected topics from other areas of advanced mathematics such as number theory, abstract algebra, topology, and real analysis.', 'Undergraduate'),
('MA4360', 'Differential Equations', 'MAT', 3, 'A study of differential equations and their applications; ordinary differential equations with particular emphasis on linear differential equations, systems of differential equations, boundary value problems and applications to electrical, mechanical and chemical systems.', 'Undergraduate'),
('MA5120', 'Abstract Algebra', 'MAT', 3, 'An introduction to basic algebraic structures. Topics will include groups, rings, integral domains, ideals and fields together with their homomorphisms.', 'Undergraduate'),
('MA5320', 'Advanced Calculus I', 'MAT', 3, 'An analytical study of the theory underlining calculus. Topics will include the real number system, limits, continuity, uniform continuity, differentiability, sequences and series of functions, uniform convergence, Taylor series, theory of integration, elementary transcendental functions.', 'Undergraduate'),
('MA6100', 'Advanced Real Analysis', 'MAT', 6, 'Explores advanced topics in real analysis, including measure theory, Lebesgue integration, functional analysis, and the theory of distributions, providing a rigorous foundation for understanding mathematical structures.', 'Graduate'),
('MA6150', 'Abstract Algebra', 'MAT', 6, 'Covers advanced algebraic structures such as groups, rings, fields, modules, and their applications, emphasizing theoretical proofs and the study of algebraic systems.', 'Graduate'),
('MA6200', 'Complex Analysis', 'MAT', 6, 'Investigates complex functions, contour integration, analytic continuation, and applications of complex variables in mathematics and other fields like physics and engineering.', 'Graduate'),
('MA6250', 'Differential Geometry', 'MAT', 6, 'Studies the geometry of curves and surfaces in three-dimensional space, including topics like curvature, geodesics, Riemannian manifolds, and their applications in physics and differential equations.', 'Graduate'),
('MA6300', 'Numerical Analysis', 'MAT', 6, 'Explores algorithms and computational methods for solving mathematical problems, including approximation theory, numerical linear algebra, optimization, and error analysis.', 'Graduate'),
('MA6350', 'Topology', 'MAT', 6, 'Covers fundamental concepts in point-set and algebraic topology, exploring topics like topological spaces, homotopy theory, homology, and cohomology, with applications in geometry and other areas.', 'Graduate'),
('MA6400', 'Probability Theory', 'MAT', 6, 'Examines probability spaces, random variables, stochastic processes, limit theorems, and measure-theoretic foundations of probability, essential for understanding randomness and uncertainty in various fields.', 'Graduate'),
('MA6450', 'Partial Differential Equations', 'MAT', 6, 'Focuses on the theory and solution methods for partial differential equations, covering topics such as boundary value problems, Fourier analysis, and applications in physics and engineering.', 'Graduate'),
('MA6500', 'Combinatorics and Graph Theory', 'MAT', 6, 'Explores discrete structures, counting techniques, graph theory, network flows, and combinatorial optimization, important in computer science, cryptography, and operations research.', 'Graduate'),
('MA6550', 'Mathematical Logic', 'MAT', 6, 'Covers formal logic, proof theory, model theory, and computability theory, exploring the foundations of mathematics and the theoretical basis of algorithms and computation.', 'Graduate'),
('MS1020', 'College Alegbra', 'MIS', 3, 'A foundational mathematics course, focusing on algebraic concepts and problem-solving skills that are valuable in various scientific and technical fields.', 'Undergraduate'),
('MS1890', 'Introduction to Data Science', 'MIS', 3, 'Introductory course on data science, focusing on basic principles and techniques.', 'Undergraduate'),
('MS2000', 'Applied Statistics', 'MIS', 3, 'This class introduces statistical concepts and techniques used in various fields, emphasizing practical applications in data analysis and decision-making.', 'Undergraduate'),
('MS3030', 'Discrete Mathematics', 'MIS', 3, 'This class covers mathematical topics like combinatorics, graph theory, and logic that are essential for computer science and algorithm analysis.', 'Undergraduate'),
('MS3240', 'Operating System', 'MIS', 3, 'This course focuses on improving communication skills relevant to the technology industry, including technical writing, presentation, and documentation.', 'Undergraduate'),
('MS4100', 'Technical Communications', 'MIS', 3, '', 'Undergraduate'),
('MS4720', 'Internet and Web Technologies', 'MIS', 3, 'Students explore web development concepts, including HTML, CSS, JavaScript, and web application design, along with internet-related technologies and protocols.', 'Undergraduate'),
('MS5098', 'Computer Vision and Image Processing', 'MIS', 3, 'This course explores image and video analysis, object detection, and computer vision applications, along with the mathematics and algorithms behind them.', 'Undergraduate'),
('MS5109', 'Blockchain Technology and Cryptocurrencies', 'MIS', 3, 'Students explore blockchain technology, its applications beyond cryptocurrencies, and the principles of building secure and decentralized systems.', 'Undergraduate'),
('MS5165', 'Advanced Topics in Human-Computer Interaction', 'MIS', 3, 'This course delves into advanced HCI concepts, covering usability testing, user experience design, and interface design for emerging technologies.', 'Undergraduate'),
('MS5172', 'Advanced Analysis and Design', 'MIS', 3, 'Study of methodologies and techniques for analyzing and designing information systems.', 'Undergraduate'),
('MS5203', 'Information Systems Strategy', 'MIS', 3, 'A strategic overview of information systems and their role in modern businesses.', 'Undergraduate'),
('MS5332', 'Internet of Things (IoT) Security and Applications', 'MIS', 3, 'Students examine the security challenges and opportunities in the IoT ecosystem, learning how to design secure IoT devices and systems.', 'Undergraduate'),
('MS5398', 'Cybersecurity and Network Defense Strategies', 'MIS', 3, 'Students learn advanced cybersecurity concepts, including intrusion detection, network forensics, and the development of effective defense strategies.', 'Undergraduate'),
('MS5429', 'Advanced Database Management', 'MIS', 3, 'Exploring advanced concepts in database management and their applications in business.', 'Undergraduate'),
('MS5441', 'Secure Software Engineering and Vulnerability Analysis', 'MIS', 3, 'This course focuses on secure software development practices, vulnerability assessment, and mitigation strategies to create robust, resilient software systems.', 'Undergraduate'),
('MS5523', 'Bioinformatics and Computational Biology', 'MIS', 3, 'This course combines biology and computer science, teaching students how to analyze biological data, conduct genomics research, and develop computational tools for biology.', 'Undergraduate'),
('MS5551', 'MIS Topics', 'MIS', 3, 'Students learn about the role of information systems in business and management, focusing on topics like data analysis, decision support systems, and IT management.', 'Undergraduate'),
('MS5555', 'Machine Learning for Robotics', 'MIS', 3, 'Students explore machine learning techniques for robot control, perception, and decision-making, with applications in autonomous robotics.', 'Undergraduate'),
('MS5710', 'Computer Networks', 'MIS', 3, 'Students study the principles of computer networking, covering topics such as network protocols, data transmission, and network design.', 'Undergraduate'),
('MS6100', 'E-commerce and Online Business Strategies', 'MIS', 6, 'Explore principles and strategies for conducting online business, including e-commerce platforms, digital marketing, and online payment systems.', 'Graduate'),
('MS6150', 'Cloud DevOps and CI/CD', 'MIS', 6, 'Learn Develops practices in cloud environments, automate software delivery pipelines, and achieve rapid and reliable application deployment.', 'Graduate'),
('MS6200', 'Advanced Data Warehousing', 'MIS', 6, 'Dive into advanced concepts in data warehousing, including dimensional modeling, data integration, and optimizing data warehouses for business intelligence.', 'Graduate'),
('MS6250', 'IS Governance and Risk Management', 'MIS', 6, 'Focus on governance frameworks and risk assessment methodologies for ensuring the security, compliance, and reliability of information systems.', 'Graduate'),
('MS6300', 'IoT Data Analytics and Edge Computing', 'MIS', 6, 'Explore challenges and opportunities in analyzing data from IoT devices and utilizing edge computing for real-time data processing.', 'Graduate'),
('MS6350', 'SaaS Development', 'MIS', 6, 'Design, develop, and deploy SaaS applications with a focus on multi-tenancy, scalability, and subscription-based business models.', 'Graduate'),
('MS6400', 'Advanced Cloud Security', 'MIS', 6, 'Delve deeper into cloud security, covering topics such as identity and access management (IAM), encryption, security monitoring, and compliance in cloud environments.', 'Graduate'),
('MS6450', 'Business Process Reengineering and Digital Transformation', 'MIS', 6, 'Study methodologies for reengineering business processes to leverage digital technologies for improved efficiency and competitiveness.', 'Graduate'),
('MS6500', 'Data Privacy and GDPR Compliance', 'MIS', 6, 'Explore data privacy laws and regulations, including GDPR, and learn how to implement compliance measures within organizations.', 'Graduate'),
('MS6550', 'IT Project Management and Agile Methodologies', 'MIS', 6, 'Develop project management skills specific to IT projects, including agile and Scrum methodologies, risk management, and project delivery in dynamic environments.', 'Graduate'),
('MS7203', 'Information Systems Strategy', 'MIS', 4, 'A strategic overview of information systems and their role in modern businesses.', 'Undergraduate'),
('PE2420', 'Principles of Microeconomics', 'ECO', 3, 'An introduction to neoclassical economic theory. Consumer and producer behaviors, price formation in the market and the role of the market in allocating resources and coordinating social production are among the topics covered.', 'Undergraduate'),
('PE2430', 'Principles of Macroeconomics', 'ECO', 3, 'An introduction to conventional macroeconomic theory, including the determination of national income, government taxing and spending policy, money and banking, unemployment, and inflation.', 'Undergraduate'),
('PE3201', 'Statistics', 'ECO', 3, 'Surveys the basic topics of modern statistics, including descriptive statistics, probability theory, probability distributions, hypothesis testing, simple regression.', 'Undergraduate'),
('PE3400', 'Global South', 'ECO', 3, 'Analysis of the major political, economic and social problems of the Global South (i.e. nations of Africa, Asia, Latin America, and the Caribbean). The course traces broadly the history of colonialism and considers its impact on the post-colonial political economy of the Global South. Case studies may complement the general analysis.', 'Undergraduate'),
('PE3410', 'Contemporary U.S. Political Economy', 'ECO', 3, 'This course is designed to familiarize the student with the workings of the economy within a class and institutional context. Focuses on the economic history of the United States from the perspective of competition between firms, management/worker relations and the involvement of the state in the economy.', 'Undergraduate'),
('PE3425', 'Economic Analysis-Micro', 'ECO', 3, 'An inâ€‘depth study of price theory. Develops and redefines the neoclassical principles presented in PE 2420. Emphasizes the application of economic theory to public policy making.', 'Undergraduate'),
('PE3435', 'Economic Analysis-Macro', 'ECO', 3, 'A detailed analysis of classical, Keynesian, monetarist, and rational expectation theories of income determination and growth.', 'Undergraduate'),
('PE3440', 'International Economics', 'ECO', 3, 'The focus of this course is international trade theory and policy. It covers as well certain fundamental aspects of international monetary economics. The curriculum is designed to provide students with the basic skills required for an understanding and critical analysis of the principal global economic issues facing the United States and the world today.', 'Undergraduate'),
('PE4100', 'International Organizations in the Global Economy', 'ECO', 3, 'This course explores various approaches to international organizations and the contribution these organizations make to the creation, maintenance, and change of world order. Current issues facing the United Nations and its specialized agencies, the Bretton Woods financial institutions, and regional organizations will be examined. While much attention is given in this course to the role of permanent, intergovernmental organizations, the course also examines the role of nongovernmental organizations, international law, treaties, and norms in international relations.', 'Undergraduate'),
('PE4275', 'Applied Econometrics', 'ECO', 3, 'Builds on the knowledge and skills in statistics by the study of simple and multiple regression analysis to test empirical propositions in economics and to forecast economic time series. Students are also required to become fluent in the use of a statistics computer program.', 'Undergraduate'),
('PE4290', 'Environmental Economics', 'ECO', 3, 'This course examines issues involved in sustainable development and is designed as a broad survey covering the most critical topics in environmental economics. The significant contribution that economic analysis can make in understanding the nature of problems in sustainable development and in providing possible solutions is the central focus of the course. Market failures are the cause of many of our most serious environmental problems but can be remedied with economic tools. The role that economic and political institutions play in allocating natural resources is examined. Students are exposed to a number of emerging sustainability issues including global warming and given ample opportunities to develop their own perspective.', 'Undergraduate'),
('PE4409', 'Urban Economics', 'ECO', 3, 'This course examines the evolution of cities and metropolitan areas as centers of production and the relationship of urban economics to regional, national, and international economics. Attention is paid to the failure to meet the needs of significant numbers of people in urban areas.', 'Undergraduate'),
('PE4430', 'Health Economics', 'ECO', 3, 'Health Economics provides a broad overview of healthcare delivery and finance systems, both in the U.S. and abroad, and explores the role that economic theory plays in the national healthcare reform debate. The student will be introduced to a number of basic theoretical tools used in economics to explain the allocation of scarce resources in healthcare markets. The course will also explore a number of controversial questions involving the rationing of care, â€œmarket failuresâ€ in the current healthcare system, disparities in access to care, and the extent to which recent healthcare reform legislation addresses these issues.', 'Undergraduate'),
('PE4440', 'Food and Wine Economics', 'ECO', 3, 'The purpose of this course is to provide students with a systematic introduction to basic economic concepts and issues as they relate to the food and wine industry. The process requires an understanding of the microeconomic and macroeconomic forces influencing the decisions of producers and consumers. Topics include supply and demand of food and wine, food and wine production function, both under perfect and imperfect competition as well as an introduction to behavioral economics. The course also addresses concepts in natural resources such as the tragedy of the commons and externalities, as well as government programs.', 'Undergraduate'),
('PE4455', 'Economic Development', 'ECO', 3, 'A comparative study of economic development strategies and problems of Third World countries. The course will locate the application of development strategies in different institutional and political settings. The implication of debt repayment on economic development will also be examined.', 'Undergraduate'),
('PE4460', 'International Finance', 'ECO', 3, 'Surveys three areas: international financial markets; open-economy macroeconomics; and international monetary systems and policy. Specific topics include position taking, arbitrage, parity conditions, international banking, monetary and fiscal policy, capital mobility, fixed and flexible exchange rates, the gold standard, Bretton Woods, and the current â€œfree marketâ€ international monetary order.', 'Undergraduate'),
('PE4470', 'History of Economic Thought', 'ECO', 3, 'Surveys both the central tenets and the divergences among various schools of economic thought, e.g., classical, American institutionalism, Keynesianism, etc. The relationship between economic ideas and their social contexts is emphasized.', 'Undergraduate'),
('PE4590', 'Global Economy in the 20th Century', 'ECO', 3, 'Global Economy in the 20th Century', 'Undergraduate'),
('PE4600', 'Depression Economics: Lessons from the Great Depression and the Great Recession', 'ECO', 3, 'This course studies depression economics-a recently revived branch of macroeconomics that seeks to understand the causes and policy remedies for large, contagious, global collapses in output and employment. We will analyze the causes and policy remedies for depressions by comparing and contrasting the Great Depression of the 1930s with the Great Recession of 2008. The advantage of the comparative approach is that it will enable us to isolate important common characteristics of these two depressions; the circumstances that made each of these crises unique; and it can provide important lessons for thinking about how to prevent future depressions.', 'Undergraduate'),
('PE4615', 'Public Finance and Public Policy', 'ECO', 3, 'Public finance (also known as public economics) analyzes the impact of public policy on the allocation of resources and the distribution of income in the economy. Government affects almost everything that we do in our daily lives, sometimes for the better, sometimes for the worse. In this course, you will learn how to use the tools of microeconomics and empirical analysis to study the taxing and the spending activities of government. Some topics covered in this class will include issues of social security, health insurance, income distribution and welfare programs, externalities and public good, and taxation.', 'Undergraduate'),
('PE6100', 'Advanced Microeconomic Theory', 'ECO', 6, 'Explores advanced concepts in individual decision-making, market structures, game theory, and general equilibrium models, providing a deeper understanding of economic agents\' behavior.', 'Graduate'),
('PE6150', 'Macroeconomic Analysis and Policy', 'ECO', 6, 'Examines advanced macroeconomic models, including growth theory, business cycles, monetary and fiscal policy, and their applications to real-world economic issues and policymaking.', 'Graduate'),
('PE6200', 'Econometrics and Applied Regression Analysis', 'ECO', 6, 'Focuses on advanced statistical methods used in economics, emphasizing regression analysis, time-series modeling, and causal inference techniques applied to economic data.', 'Graduate'),
('PE6250', 'International Trade and Finance', 'ECO', 6, 'Investigates theories of international trade, trade policy, exchange rates, balance of payments, and the implications of globalization on economies, emphasizing policy implications and trade dynamics.', 'Graduate'),
('PE6300', 'Labor Economics', 'ECO', 6, 'Explores theories of labor markets, wage determination, human capital, unemployment, and the impact of government policies and labor market institutions on workforce outcomes.', 'Graduate'),
('PE6350', 'Financial Economics', 'ECO', 6, 'Covers theories of asset pricing, portfolio management, financial markets, and corporate finance, examining the intersection of economics and finance with a focus on investment decisions and risk management.', 'Graduate'),
('PE6400', 'Development Economics', 'ECO', 6, 'Analyzes economic growth, poverty, inequality, and development policies in both theoretical and empirical contexts, exploring the challenges and strategies for promoting economic development.', 'Graduate'),
('PE6450', 'Public Economics and Policy', 'ECO', 6, 'Explores the role of government in the economy, including taxation, public expenditures, social insurance, and regulatory policies, evaluating their efficiency and distributional implications.', 'Graduate'),
('PE6500', 'Environmental and Resource Economics', 'ECO', 6, 'Examines economic theories and policies related to environmental issues, natural resource management, sustainability, and the valuation of environmental goods and services.', 'Graduate'),
('PE6550', 'Applied Economic Analysis and Forecasting', 'ECO', 6, 'Focuses on applying economic theory and quantitative methods to analyze real-world economic problems, emphasizing forecasting techniques and policy analysis.', 'Graduate'),
('PH2220', 'Structure of Physics I', 'PHY', 2, 'A nonâ€‘calculus, introductory physics course for biological science, health sciences and premedical students. Topics included are the principles and laws of mechanics, kinematics, energy and rotational motion.', 'Undergraduate'),
('PH2221', 'Structure of Physics I Laboratory', 'PHY', 1, 'A laboratory course illustrating topics covered in CP 2220.', 'Undergraduate'),
('PH2230', 'Structure of Physics II', 'PHY', 2, 'A continuation of Structure of Physics I. Topics include wave motion and sound, electricity and magnetism, physical and geometric optics and selected topics from nuclear physics.', 'Undergraduate'),
('PH2231', 'Structure of Physics II Laboratory', 'PHY', 1, 'A laboratory course illustrating topics covered in CP 2230.', 'Undergraduate'),
('PH2240', 'General Physics I', 'PHY', 2, 'The first semester of a calculusâ€‘based introductory physics course primarily for chemistry and math majors. Kinematics, energy, momentum and rotational motion are included.', 'Undergraduate'),
('PH2241', 'General Physics I Laboratory', 'PHY', 1, 'A laboratory course illustrating topics covered in CP 2240.', 'Undergraduate'),
('PH2250', 'General Physics II', 'PHY', 2, 'The second semester of a calculusâ€‘based general physics course. Optics, electricity, wave motion and magnetism are included.', 'Undergraduate'),
('PH2251', 'General Physics II Laboratory', 'PHY', 1, 'A laboratory course illustrating topics covered in CP 2251.', 'Undergraduate'),
('PH2260', 'General Physics III', 'PHY', 2, 'The third course in the General Physics sequence provides an overview of the fundamentals and analytical methods of physics. Students will learn to think logically and quantitatively about the behavior of nature and gain a systematic approach to problem solving. This course will cover selected classical topics, including harmonic oscillations, waves, optics, and fluid mechanics, as well as an introduction to select topics in modern physics, including special relativity, quantum mechanics, atomic, nuclear, and particle physics. Students enrolled in CP 2260 General Physics III should concurrently enroll in the associated lab course, CP 2261 - General Physics III Laboratory.', 'Undergraduate'),
('PH2261', 'General Physics III Laboratory', 'PHY', 1, 'A three-hour laboratory course illustrating the topics covered in CP 2260. Students enrolled in CP 2261 should concurrently enroll in CP 2260 - General Physics III.', 'Undergraduate'),
('PH3230', 'Mathematical Methods in the Physical Sciences', 'PHY', 3, 'Application of advanced mathematical principles to problems in the physical sciences. Topics include infinite and power series, functions of several variables, matrix and vector algebra, Fourier analysis, special functions and differential equations.', 'Undergraduate'),
('PH3600', 'Mechanics', 'PHY', 3, 'This course will cover the basic ideas and techniques of analytical mechanics, in particular the calculus of variations, Hamiltonâ€™s Principle, and Lagrangian dynamics. Topics will include conservation laws, oscillations and waves, gravity and central force motion, and chaos.', 'Undergraduate'),
('PH3700', 'Electromagnetism', 'PHY', 3, 'Physics PH 3700 is an upper division course covering the topic of electrostatics and magnetostatics. The topics covered include electrostatics; special techniques for differential equations; electric fields in matter; magnetostatics and magnetic fields in matter and Maxwellâ€™s equations.', 'Undergraduate'),
('PH3800', 'Relativity', 'PHY', 3, 'This course will present the concepts and principles of Einsteinâ€™s theory of special relativity, as well as an introduction to general relativity. Topics will include relativistic kinematics and mechanics, Minkowski spacetime, Lorentz transformations, four-vectors, the metric, and spacetime curvature. Applications to particle physics, astrophysics, and cosmology will be covered.', 'Undergraduate'),
('PH3900', 'Experimental Physics and Electronics Lab', 'PHY', 3, 'This course provides an introduction to the electronics and instrumentation used in experiments. Topics include DC and AC circuits, filters, power supplies, transistors, diodes and operational amplifiers and if time permits analog to digital converters and logic. This is primarily a lab class, but time will also be spent in and out of the class on the mathematical description of the circuits and instruments, as well as, discussions of the theory underlying modern components, such as the diode and transistor.', 'Undergraduate'),
('PH4100', 'Thermodynamics', 'PHY', 3, 'An introduction to the concepts and laws of thermodynamics and their statistical basis. Topics will include temperature, heat, thermal equilibrium, reversible and irreversible processes, entropy, and free energy. Applications such as ideal gases, Einstein solids, spin systems, heat engines, refrigerators, black holes, and phase transitions will be covered.', 'Undergraduate'),
('PH4200', 'Quantum Mechanics', 'PHY', 3, 'This course is an introduction to the concepts and methods of quantum mechanics. Topics will include the postulates of quantum mechanics. SchrÃ¶dingerâ€™s equation, Dirac notation, measurements, operators and observables, angular momentum and spin, and the exclusion principle. Applications will include harmonic oscillator, the hydrogen atom, and scattering.', 'Undergraduate'),
('PH4600', 'Applied Mechanics', 'PHY', 3, 'Physics PH 4600 is the study of statics and dynamics of rigid bodies and of stress and strain applied to â€œrealâ€ materials with elasticity and finite strength. Topics include simple equilibrium, structural analysis, inertia tensors, centroids, energy and momentum, and strength of materials, as well as, concepts of stress and strain in structural members experiencing tension, compression, shear, bending, and twisting.', 'Undergraduate'),
('PH4900', 'Econophysics', 'PHY', 3, 'In this course, we will introduce the dynamics of markets from a physics perspective. We will introduce the statistical methods needed to model financial markets: classes of Brownian motion, probability distributions and limit theorems. Comparison with other physical systems will be used to develop intuitions for these methods.', 'Undergraduate'),
('PH5920', 'Seminar I', 'PHY', 3, 'Capstone course in which the student integrates coursework in the sub-disciplines to discuss topics of current interest in the profession. Includes instruction in library resources and on-line searching, scientific writing, ethics workshops and oral presentations. Students choose a supervisor and seminar topic and submit a draft written report. Attendance at Science Seminar Series is required.', 'Undergraduate'),
('PH6100', 'Advanced Quantum Mechanics', 'PHY', 6, 'Explores advanced quantum theory, including formalism, perturbation theory, scattering, and applications in atomic, molecular, and condensed matter physics.', 'Graduate'),
('PH6150', 'Electrodynamics and Electromagnetic Theory', 'PHY', 6, 'Covers advanced topics in classical electromagnetism, including Maxwell\'s equations, electromagnetic waves, radiation, and relativistic electrodynamics.', 'Graduate'),
('PH6200', 'Statistical Mechanics and Thermodynamics', 'PHY', 6, 'Investigates the principles of statistical mechanics, ensembles, phase transitions, and the connection between microscopic behavior and macroscopic properties of matter.', 'Graduate'),
('PH6250', 'Advanced Classical Mechanics', 'PHY', 6, 'Focuses on advanced topics in classical mechanics, including Lagrangian and Hamiltonian formalisms, canonical transformations, and applications in celestial mechanics and nonlinear dynamics.', 'Graduate'),
('PH6300', 'Particle Physics and High-Energy Physics', 'PHY', 6, 'Explores fundamental particles and interactions, symmetries, the Standard Model, and experimental techniques used in high-energy physics research.', 'Graduate'),
('PH6350', 'Condensed Matter Physics', 'PHY', 6, 'Covers the properties of condensed matter systems, including solid-state physics, materials science, quantum phenomena in solids, and electronic properties of materials.', 'Graduate'),
('PH6400', 'Astrophysics and Cosmology', 'PHY', 6, 'Examines astrophysical phenomena, celestial mechanics, stellar structure, cosmology, and the large-scale structure and evolution of the universe.', 'Graduate'),
('PH6450', 'Nuclear Physics', 'PHY', 6, 'Studies the structure and properties of atomic nuclei, nuclear reactions, nuclear models, and applications in nuclear energy and astrophysics.', 'Graduate'),
('PH6500', 'Optics and Photonics', 'PHY', 6, 'Focuses on the principles of optics, wave optics, light-matter interactions, and modern photonics technologies, including lasers and optical communication systems.', 'Graduate'),
('PH6550', 'Quantum Field Theory', 'PHY', 6, 'Explores advanced concepts in quantum field theory, including relativistic quantum mechanics, quantum electrodynamics (QED), and quantum chromodynamics (QCD).', 'Graduate'),
('PL1000', 'Introduction to Political Science', 'POL', 3, 'An overview of the principles, concepts, and foundational theories in political science, exploring the study of government, politics, and their impact on society.', 'Undergraduate'),
('PL1050', 'Comparative Politics and Government', 'POL', 3, 'Analyzing political systems and institutions worldwide, with a focus on comparing different governments, ideologies, and the factors that shape political outcomes.', 'Undergraduate'),
('PL1100', 'Political Theory and Ideologies', 'POL', 3, 'An exploration of political philosophies, ideologies, and the evolution of political thought throughout history, including liberalism, conservatism, socialism, and feminism.', 'Undergraduate'),
('PL1150', 'International Relations and Global Politics', 'POL', 3, 'Examining the dynamics of international relations, diplomatic processes, global conflicts, and the role of international organizations and treaties.', 'Undergraduate'),
('PL1200', 'American Government and Politics', 'POL', 3, 'A comprehensive study of the U.S. political system, including the Constitution, branches of government, political parties, and the policymaking process.', 'Undergraduate'),
('PL1250', 'Public Policy Analysis and Implementation', 'POL', 3, 'An in-depth look at policy analysis, development, and the challenges involved in implementing government policies at the local, state, and federal levels.', 'Undergraduate'),
('PL1300', 'Political Research Methods and Data Analysis', 'POL', 3, 'An introduction to research methodologies, data collection, and analysis techniques used in political science research.', 'Undergraduate'),
('PL1350', 'Political Parties and Elections', 'POL', 3, 'Exploring the role of political parties, the electoral process, voting behavior, campaign strategies, and the impact of elections on governance.', 'Undergraduate'),
('PL1400', 'Political Economy and Economic Policy', 'POL', 3, 'Analyzing the intersection of economics and politics, including economic policy, globalization, trade, and the impact on political decision-making.', 'Undergraduate'),
('PL1450', 'Political Leadership and Decision-Making', 'POL', 3, 'Investigating leadership theories, leadership styles, and the decision-making processes of political leaders and officials.', 'Undergraduate'),
('PL1500', 'Political Ethics and Values', 'POL', 3, 'An examination of ethical dilemmas in politics, the moral foundations of political decisions, and the role of values in policymaking.', 'Undergraduate'),
('PL1550', 'Environmental Politics and Policy', 'POL', 3, 'Focusing on environmental issues, sustainability, and the development and impact of environmental policies on a local and global scale.', 'Undergraduate'),
('PL1600', 'Human Rights and Social Justice', 'POL', 3, 'Delving into human rights, social justice movements, and the policies and institutions designed to protect and promote human rights.', 'Undergraduate'),
('PL1650', 'Law and Politics', 'POL', 3, 'Analyzing the intersection of law and politics, including the role of the legal system in shaping political decisions and governance.', 'Undergraduate'),
('PL1700', 'National Security and Defense Policy', 'POL', 3, 'Examining national security strategies, defense policy, intelligence, and the challenges of maintaining a nation\'s security in a complex world.', 'Undergraduate'),
('PL1750', 'Gender and Politics', 'POL', 3, 'Investigating gender dynamics, women\'s rights, gender policies, and the role of gender in political representation and decision-making.', 'Undergraduate'),
('PL1800', 'Political Communication and Media', 'POL', 3, 'Exploring the impact of media, communication strategies, and the role of information dissemination in political campaigns and governance.', 'Undergraduate'),
('PL1850', 'Public Administration and Bureaucracy', 'POL', 3, 'A study of public administration principles, bureaucracy, and the functioning of government agencies and their impact on public policy.', 'Undergraduate'),
('PL1900', 'International Law and Diplomacy', 'POL', 3, 'An examination of international law, diplomatic negotiations, treaty obligations, and the role of diplomacy in resolving global conflicts and disputes.', 'Undergraduate'),
('PL2000', 'Political Geography and Geopolitics', 'POL', 3, 'This course explores the influence of geography on politics and international relations, including the analysis of borders, territory, and the geopolitical factors that shape global conflicts and alliances.', 'Undergraduate'),
('PL6100', 'Political Theory and Philosophy', 'POL', 6, 'Explores foundational political theories and philosophical frameworks, analyzing key thinkers and concepts that shape political thought and governance.', 'Graduate'),
('PL6150', 'Comparative Politics', 'POL', 6, 'Examines political systems, institutions, and processes across different countries and regions, focusing on comparative analysis of governance, democratization, and political behavior.', 'Graduate'),
('PL6200', 'International Relations Theory', 'POL', 6, 'Covers theoretical frameworks in international relations, including realism, liberalism, constructivism, and critical theories, to analyze global politics, diplomacy, and international cooperation.', 'Graduate'),
('PL6250', 'Public Policy Analysis', 'POL', 6, 'Focuses on methods of policy analysis, policy formulation, and evaluation, examining the role of government, stakeholders, and institutions in shaping public policies.', 'Graduate'),
('PL6300', 'Political Economy', 'POL', 6, 'Explores the intersection of politics and economics, analyzing the influence of economic factors on political decision-making, policy formation, and global economic governance.', 'Graduate'),
('PL6350', 'Security Studies and Conflict Resolution', 'POL', 6, 'Examines theories and practices related to national and international security, conflict resolution, peacebuilding, and the management of global conflicts.', 'Graduate'),
('PL6400', 'Political Sociology', 'POL', 6, 'Studies the relationship between politics and society, analyzing power structures, social movements, political behavior, and the impact of social forces on political systems.', 'Graduate'),
('PL6450', 'Media and Politics', 'POL', 6, 'Explores the role of media in shaping political discourse, public opinion, and political communication strategies, examining the intersection of media, technology, and governance.', 'Graduate'),
('PL6500', 'Human Rights and Global Governance', 'POL', 6, 'Focuses on human rights theories, international legal frameworks, and global governance mechanisms, addressing issues of justice, equality, and human rights protection.', 'Graduate'),
('PL6550', 'Environmental Politics and Policy', 'POL', 6, 'Examines the intersection of politics and environmental issues, analyzing environmental policymaking, sustainability, climate change governance, and the role of international agreements.', 'Graduate'),
('PY2010', 'Introduction to Psychology', 'PSY', 3, 'This course is a prerequisite to most of the psychology courses within the major. This course investigates basic psychological principles of behavior based on the scientific method. The socio-cultural context in which humans develop is emphasized throughout. Areas of psychology to be covered include biological, cognitive, social, personality, clinical, diversity and social justice.', 'Undergraduate'),
('PY2530', 'Psychology of Prejudice & Discrimination', 'PSY', 3, 'This course explores the causes and consequences of prejudice and discrimination as social and psychological processes on individuals, groups and communities. The effects of prejudice, stereotypes, and discrimination and how they contribute to structural inequalities are investigated. Emphasis will be placed on the role of intersectional social group identities on oneâ€™s understanding and experiences of prejudice and discrimination, and an examination of social action principles that address these dynamics.', 'Undergraduate'),
('PY2720', 'Psychology of Gender', 'PSY', 3, 'This course examines the psychological, biological, and sociocultural correlates of gender. Theories of gender development, construction of gender identity, sexual orientation, and intersectionality of gender with other social group identities will be explored. Emphasis will be placed on the social constructs of traditional â€œmasculineâ€ and â€œfeminineâ€ gender roles throughout the lifespan with a consideration of relationships, education and career paths.', 'Undergraduate'),
('PY3010', 'Research Design and Analysis I', 'PSY', 3, 'Introduces the student to the basic research methodologies and statistical techniques used by psychological scientists, with a focus on descriptive and correlational methods. Emphasis is placed on the process of scientific inquiry in general, and the concepts and terminology of psychological research in particular. Through a combination of lecture and laboratory exercises, students will learn to locate, read, and critique articles from the professional literature in psychology; understand the essential elements and principles of research design, including ethical considerations; conduct basic statistical analyses; interpret and graphically represent quantitative information; and write a literature review and/or empirical research report in the style recommended by the American Psychological Association.', 'Undergraduate'),
('PY3215', 'Foundations of Child Development', 'PSY', 3, 'This course focuses on child development (ages 0-12). Major theories and research evidence will be presented relating to three areas of childrenâ€™s growth and development: (1) physical, including sensory-motor and brain development; (2) cognitive, including language, information processing and memory, problem solving, and metacognition; and (3) emotional and psychosocial, including self-identity, self-concept, and social functioning. Factors affecting childrenâ€™s development, including socioeconomic status, racial and multicultural backgrounds, gender and other diversity will be discussed throughout the course, along with additional societal influences, such as family, peer, schools and teachers, and the media. Lectures, videos and discussions, class exercises, and assigned projects are intended to enhance understanding of healthy growth and relevant issues and threats to childrenâ€™s development.', 'Undergraduate'),
('PY3230', 'Adulthood & Aging', 'PSY', 3, 'This course explores psychological development in the social context from early adulthood to old age. Personality theories and research methods as they apply to the study of aging are reviewed. Life cycle changes in family and work structure and roles are discussed. Additional topics include demographics, coping and successful aging, health, friendship and community, and death and dying. The impact of gender, culture and race and socioeconomic background are examined throughout. The course includes in-class exercises and a senior interview project.', 'Undergraduate'),
('PY3240', 'Lifespan Development', 'PSY', 3, 'This course will examine major theories and findings on human development, including stages of the lifespan that range from prenatal development through advanced old age. Each stage of the lifespan will be discussed within the context of physical, cognitive, and social/emotional development. Topics will also include research in developmental psychology, genetic foundations of development, as well as end of life issues.', 'Undergraduate'),
('PY3310', 'Foundations in Clinical Psychology', 'PSY', 3, 'Explores mental health challenges. In addition to surveying clinical-diagnostic systems, the course examines diverse experiences of mental distress as well as various explanatory models (e.g., biological, psychological, social, and cultural). Special attention is given to emerging areas of clinical research.', 'Undergraduate'),
('PY3311', 'Theories of Personality', 'PSY', 3, 'A survey of the major theories of personality and personality development, including psychoanalytic, behaviorist, cognitive, existential, and sociocultural theories.', 'Undergraduate'),
('PY3410', 'Cognitive Psychology', 'PSY', 3, 'Theoretical, conceptual and empirical issues in cognition will be examined from an information processing perspective. The course also includes a survey of neurophysiological aspects of perception, memory and cognitive processes.', 'Undergraduate'),
('PY3420', 'Learning and Motivation', 'PSY', 3, 'Explores major theoretical and empirical issues in the area of learning, classical and operant conditioning, and examines the role of motivation and emotion in learning. The course also surveys physiological, psychoanalytic and social learning theories of motivation and emotion.', 'Undergraduate'),
('PY3510', 'Social Psychology', 'PSY', 3, 'This course is an introduction to the field of social psychology, which focuses on how we think and behave in social settings, and how our environment influences our behavior. Topics include attitude formation and change, social influence, persuasion, conformity and norms, group dynamics and group pressure, prosocial behavior, aggression, and prejudice and discrimination.', 'Undergraduate'),
('PY3530', 'Community Psychology', 'PSY', 3, 'This course focuses on the application of community psychology action principles and research practices to the development and provision of resources and services necessary to well-functioning communities. Discussions cover prevention and intervention programs, empowerment, advocacy, and the impact of structural inequalities, political and social organization, and social group identity on community well-being. Special emphasis is placed on the application of concepts to social issues.', 'Undergraduate'),
('PY3610', 'Brain & Behavior', 'PSY', 3, 'The course examines how the brainâ€™s mental processes regulate physiological changes in neurons thereby altering the expression of behaviors. Examples are drawn from both animal and human studies to establish structure-function relationships. Topics covered include: the structure and function of nerve cells, brain anatomy, psychopharmacology, and the genetics and evolution of behavior. Complex behaviors examined include: vision, audition, olfaction, gustation, somatosensation, vestibulation, sleep, learning, memory, cognition speech, and emotional/affective behaviors.', 'Undergraduate'),
('PY3620', 'Drugs & Behavior', 'PSY', 3, 'This course examines the use of psychoactive medication in the treatment of psychiatric disorders. Basic principles of psychopharmacology are presented. Brain/behavior relationships in normal and abnormal functioning are reviewed with respect to neurotransmitter pathways and the medications that affect them. Medication and psychotherapy integration is emphasized.', 'Undergraduate'),
('PY3710', 'Psychology and Social Justice', 'PSY', 3, 'This course will introduce the concept and theoretical basis of social justice and explore the experiences and psychological impacts of inequality, oppression, and privilege. Emphasis will be placed on investigating the structural dynamics behind the maintenance of oppressive institutions and systems, understanding the role of psychology in social issues, and applying social action principles to social problems and social movements. In addition to an intellectual understanding of social justice, this course will provide a framework for utilizing a social justice perspective in subsequent courses and in life actions.', 'Undergraduate'),
('PY4130', 'Field Experience and Research', 'PSY', 3, 'Students engage in supervised experience and field work in a wide variety of clinical, psychiatric/ psychological, community organizational and agency settings in mental and physical health, community action and civic engagement and social welfare settings. A weekly seminar will include student presentation of placement experiences and issues relevant to successful field work and service delivery. The impact of systematic structural inequalities, prejudice and discrimination, diversity and multicultural sensitivity are integrated into issues relevant to the availability and success of community mental health professionals and community resources. Field research techniques including observational methods and field notes will be covered in preparation for a final research paper integrating the internship experience with literature review. Students are required to engage in an approved placement 80 hours (distributed over at least ten weeks).', 'Undergraduate'),
('PY4200', 'Research Design and Analysis II', 'PSY', 3, 'This is the second course of the integrated Research Methods sequence. This aim of this course is to train students in the methods, design, and implementation of research in Psychology. Students will critically review primary source literature, generate testable hypotheses, collect and analyze data using appropriate statistical techniques in SPSS. Emphasis is placed on drawing evidence-based conclusions and the ability to communicate, in oral presentation and in written form using APA style. Assignments for this course include a literature review, data collection, statistical analysis and a complete APA-style empirical research report.', 'Undergraduate'),
('PY5210', 'Senior Seminar in Developmental Psychology', 'PSY', 3, 'This course provides an in-depth evaluation of theory and research about specific periods in the human lifespan, such as childhood, adolescence, and young, middle and late adulthood. A major theme of the course will be research strategies and designs used to study human development. Course topics and projects will examine biological, cognitive, psychological and/or socioemotional functioning across the lifespan, along with biopsychosocial factors that may influence such functioning, including socioeconomic factors, gender, and ethnic, racial/ multiracial, and cultural background.', 'Undergraduate'),
('PY5510', 'Senior Seminar in Social Psychology', 'PSY', 3, 'This course focuses on areas of theory and research of current concern to social psychologists. Content that may be covered in this course includes: psychological aspects of public policies and programs; power, oppression and liberation; impact of resource disparities; environmental and economic sustainability; stigma and stereotypes; impact of media on social behavior; social conflict and group functioning; social inclusion and exclusion; empowering settings; impact of social structure on psychological functioning; or the impact of community-based research methods on social issues.', 'Undergraduate'),
('PY6100', 'Advanced Cognitive Psychology', 'PSY', 6, 'Explores advanced theories and empirical research on cognitive processes such as attention, memory, problem-solving, and decision-making, examining their neural underpinnings and real-world applications.', 'Graduate'),
('PY6150', 'Developmental Psychopathology', 'PSY', 6, 'Investigates the complex interplay between developmental processes and psychopathology, examining how various factors contribute to atypical psychological development across the lifespan.', 'Graduate'),
('PY6200', 'Neuropsychology and Brain Imaging', 'PSY', 6, 'Analyzes the relationship between brain structure, function, and behavior through advanced neuroimaging techniques, offering insights into the neural basis of cognition, emotion, and clinical disorders.', 'Graduate'),
('PY6250', 'Advanced Social Psychology', 'PSY', 6, 'Explores in-depth social phenomena, including group dynamics, social influence, prejudice, and intergroup relations, utilizing advanced methodologies to understand the complexities of human social behavior.', 'Graduate'),
('PY6300', 'Clinical Neuropsychology', 'PSY', 6, 'Focuses on the assessment, diagnosis, and rehabilitation of individuals with neurological disorders, integrating knowledge of brain-behavior relationships into clinical practice.', 'Graduate'),
('PY6350', 'Psychotherapy and Counseling Techniques', 'PSY', 6, 'Examines diverse therapeutic modalities, their theoretical underpinnings, and empirical evidence, preparing students to apply various approaches in clinical settings.', 'Graduate'),
('PY6400', 'Psychometrics and Psychological Assessment', 'PSY', 6, 'Covers advanced measurement theory and techniques used in developing and evaluating psychological tests and assessments, emphasizing reliability, validity, and ethical considerations.', 'Graduate'),
('PY6450', 'Health Psychology and Behavioral Medicine', 'PSY', 6, 'Explores the relationship between psychological factors, behavior, and physical health, examining interventions to promote health behavior change and improve overall well-being.', 'Graduate'),
('PY6500', 'Cultural Psychology and Diversity', 'PSY', 6, 'Investigates the influence of culture on psychological processes and behavior, addressing diversity, multiculturalism, and their implications for understanding human behavior.', 'Graduate'),
('PY6550', 'Research Methods and Statistical Analysis in Psychology', 'PSY', 6, 'Provides advanced training in experimental design, statistical analysis, and research methodologies, equipping students with the skills necessary to conduct rigorous psychological research.', 'Graduate'),
('SY1500', 'Introductory Sociology', 'SOC', 3, 'Introduces basic concepts and perspectives in sociology. Such major social institutions as the family, education, politics, law, media, and religion are examined, together with such social processes as socialization, social change, social control, and social stratification. In addition, the course surveys some of the research methods and social theories in sociology. Designed as a general interest and Liberal Education Curriculum course. Required for sociology and criminology majors.', 'Undergraduate'),
('SY2222', 'Sociology of Caring', 'SOC', 3, 'This course will examine the subject of care work with a focus on the ways in which social processes and institutions shape individual experiences (and vice versa). Drawing on historical and contemporary illustrations of the paid and unpaid work of caring, we will use a sociological lens to consider questions such as: What does it mean to care? Who receives care? Who does the work of caring? Where, and under what circumstances, does this work happen? At what costs does care work happen, and how is that work valued and supported? How are paid and unpaid care work divided along lines of gender, race, class, and nationality? Throughout the course, students will engage with these questions by applying sociological concepts to popular debates, historical events, and original data.', 'Undergraduate'),
('SY2400', 'Sociology Through the Arts', 'SOC', 3, 'This course considers the dynamic tension that exists between artists and the many roles that the arts have had in society by examining the literary arts, visual arts, and the performing arts (in sum: painting and drawing; music, dance and theater; literature and poetry; and, photography and film/video). In the process of exploring the arts, we will consider the social factors that enable artistic expression to come to fruition as artistic genres are constructed. We will also analyze how the arts may serve as boundary-making social activity (i.e., by contesting an indicator of taste or style), or as boundary-breaking cultural endeavors (i.e., by contesting social rules and norms). Students will learn to critically assess the function of the arts at both the local, â€œstreetâ€ level, as well as art circulating in the global marketplace. Students will also be encouraged to produce their own artistic contribution in response to the course material, thereby experiencing the connection between art and society as a distinctive component of our common humanity.', 'Undergraduate'),
('SY2550', 'Social Problems', 'SOC', 3, 'Examines the historical and contemporary roots of critical social problems such as poverty, unemployment, ecological despoliation, delinquency, population growth, etc. Also of concern are the social policies directed toward these problems and an examination of their present and future consequences', 'Undergraduate'),
('SY2600', 'Social Deviance', 'SOC', 3, 'Examines the patterns of deviant behavior in American society. Concentrates on the social construction of deviance: how various deviant labels are defined and applied (e.g. crime and mental illness) and the social consequences for those labeled. Students will also study the uses of moral, legal and medical models as fundamental ways of understanding both deviant behavior and the societal response to deviants.', 'Undergraduate'),
('SY2800', 'Race, Class, Gender and Sexuality', 'SOC', 3, 'In this course students will examine the multiple and intersecting ways in which race, class, gender, and sexuality shape and are shaped by institutions, interaction, and individual experience. The course will explore the social construction of these concepts, the meanings and values attached to them, the ways in which they are embedded in sites of inequality, and on efforts to transform them.', 'Undergraduate'),
('SY3160', 'Sociology of Culture', 'SOC', 3, 'This course engages students in the social science theories and research studies in diverse culture fields of contemporary and globalized society. Material and non-material aspects of cultural analysis are explored in such fields as language, technology, arts, and media through their relationship to the culture production/consumption processes. Debates about culture, policy, and culture change are analyzed in the course, and include the new research on visual culture and civic culture.', 'Undergraduate'),
('SY3280', 'Social Inequality', 'SOC', 3, 'This course analyzes the basic dimensions of structured social inequality, the unequal distribution of wealth, power, goods and services by class, race and gender. It studies different aspects of the impact of social inequality: for example, on environmental issues; social mobility; beliefs about the justice of inequality; social movements; crime, poverty and social policy.', 'Undergraduate'),
('SY3630', 'Political Sociology', 'SOC', 3, 'Examines the social structures and processes related to participation in the political life of society. Explores the problems the political order poses for different social classes and how institutions of power and authority are maintained in efforts to foster control and legitimacy.', 'Undergraduate'),
('SY3700', 'Family and Society', 'SOC', 3, 'Through historical and comparative analysis, studies the connection between courtship and marriage patterns and different economic systems. Students examine the emergence of the modern family system, changing patterns of mate selection and courtship and the relationship between general assumptions about sex roles and role allocation in marriage itself. Comparisons are drawn across cultures and across class, race and ethnic groups in American society.', 'Undergraduate'),
('SY3750', 'Medical Sociology', 'SOC', 3, 'Explores the social forces defining and influencing health and illness. The organization and distribution of medical science and professionals are analyzed from a sociological perspective, with an emphasis on care for the poor, minorities, women, the disabled, and the aged. Alternatives to the present system of medical care in the U.S. are discussed, particularly in the context of health policy and medical care in other countries.', 'Undergraduate'),
('SY4260', 'Social Work: Theory and Practice', 'SOC', 3, 'Examines social work practice as a planned change process occurring within systems, i.e., one-to-one relationships, families, community groups. Provides a general overview of social work practice within the context of social welfare. Particular attention is paid to the structure and function of social welfare as an institution and to the development of concepts and techniques applicable to a wide variety of social work settings and situations. Addresses such issues as the types of opportunities in the field, necessary skills and the underlying value system.', 'Undergraduate'),
('SY4270', 'Internship in Social Work, Sociology and Criminology', 'SOC', 3, 'The internship program is designed for students who wish to develop practical skills and gain work experience in the fields of Social Work, Sociology and Criminology, integrating theory with professional experience. The students will have an opportunity to explore the professional world and to acquire training in their chosen area of specialization. The student in conjunction with the instructor will select a field internship and perform 90 hours of field work. Students meet regularly to discuss their experiences and progress. They will compile a portfolio of the work done on the internship and write a detailed report describing the agency and summarizing their work. The student will use psychological, sociological and criminological theories and research to explain complex social processes experienced during the field.', 'Undergraduate'),
('SY4400', 'Social Psychology', 'SOC', 3, 'Introduces the social psychological theories of sociologists and anthropologists to show how culture and society shape and influence behavior. Focus is on theories of socialization, such as symbolic interaction, behaviorism, small group theories, perception, social exchange, etc. Consideration is given to cross-cultural examples.', 'Undergraduate'),
('SY4500', 'Global Sociology', 'SOC', 3, 'The major aims of the course are to broaden student knowledge and perspectives of diverse cultures and the global society by using historical, anthropological, and sociological theories and methods. The course will review such social processes as socio-cultural evolution, development and revolution. We will do comparative analyses, and debate global issues and policies. The global issues include the environment, population, resources, and technology; global stratification, human rights, and peace and war in contemporary society.', 'Undergraduate'),
('SY4520', 'Research Methods I', 'SOC', 3, 'Introduces students to the concepts and principles of sociological research, including how to: interpret and construct academic research articles, conduct an analytic literature review, design and test research hypotheses, use appropriate sampling methods and apply ethical principles. Students will gain experience in qualitative data collection methods and analysis (e.g., intensive interviews, content analysis, ethnography, group interviews, question construction, historical/comparative studies) for sociology and criminology topics, and develop a research plan.', 'Undergraduate'),
('SY4530', 'Sociological Theory I', 'SOC', 3, 'Introduces the central concepts and theoretical frameworks of the founding figures of classical sociological theory: Marx, Durkheim, and Weber. By reading primary work by each theorist as well as secondary sources, students will learn the content of the theories, the theoristsâ€™ underlying assumptions, and the empirical bases of their analyses of society.', 'Undergraduate'),
('SY4540', 'Sociological Theory II', 'SOC', 3, 'Introduces modern developments in sociological theory. Students will read both primary and secondary contemporary theoretical writings, studying how modern theory builds on and diverges from classical theories. Major fields of contemporary theory that may be covered include: functionalism, conflict theory, neo-Marxist theories, psychoanalytic theory, feminist theory and critical race theory. The emphasis is on understanding how each theorist approaches his/her own realm of inquiry as well as the actual idea systems created.', 'Undergraduate'),
('SY4570', 'Research Methods II', 'SOC', 3, 'Trains students to collect and analyze quantitative sociological data. Topics include appropriate sampling methods, survey research, probability, tests of significance and descriptive and inferential statistics. Students are introduced to statistical logic and concepts and conduct bivariate and multivariate analyses using examples from sociology and criminology.', 'Undergraduate'),
('SY4600', 'Social Programs, Planning and Policy', 'SOC', 3, 'Analyzes formation of social policy, its effectiveness as applied to specific social institutions and programs, as well as the impact of these programs on their targeted population. Broader issues of social policy within the context of political economic systems and ideologies, as well as the general structure of the American â€œWelfare State,â€ will be discussed, using cross-cultural comparisons.', 'Undergraduate'),
('SY6100', 'Contemporary Sociological Theory', 'SOC', 6, 'Explores recent developments in sociological thought, examining theories and paradigms that address contemporary social issues and transformations in society.', 'Graduate'),
('SY6150', 'Qualitative Research Methods in Sociology', 'SOC', 6, 'Focuses on advanced qualitative research techniques, including ethnography, content analysis, and narrative analysis, emphasizing their application in sociological inquiry and data collection.', 'Graduate'),
('SY6200', 'Quantitative Analysis in Sociology', 'SOC', 6, 'Covers advanced statistical methods used in sociological research, including regression analysis, multilevel modeling, and survey design, preparing students to analyze and interpret complex social data.', 'Graduate'),
('SY6250', 'Social Stratification and Inequality', 'SOC', 6, 'Examines the structures and dynamics of social inequality based on class, race, gender, and other dimensions, exploring theories and empirical research on stratification and mobility.', 'Graduate'),
('SY6300', 'Globalization and Social Change', 'SOC', 6, 'Analyzes the impact of globalization on societies, economies, cultures, and identities, exploring interconnectedness, transnationalism, and global social movements.', 'Graduate'),
('SY6350', 'Sociology of Health and Illness', 'SOC', 6, 'Explores the social determinants of health, healthcare systems, medicalization, and health disparities, examining how social factors influence health outcomes and healthcare practices.', 'Graduate'),
('SY6400', 'Urban Sociology', 'SOC', 6, 'Focuses on the study of cities and urban life, examining issues such as urbanization, community dynamics, social inequalities in urban areas, and the impact of urban policies.', 'Graduate'),
('SY6450', 'Gender and Society', 'SOC', 6, 'Investigates the intersection of gender with social institutions, identities, and power dynamics, exploring feminist theories and empirical research on gender roles and inequalities.', 'Graduate'),
('SY6500', 'Sociology of Culture', 'SOC', 6, 'Analyzes the production, diffusion, and consumption of culture, studying cultural practices, symbolic systems, and the role of culture in shaping social life.', 'Graduate'),
('SY6550', 'Environmental Sociology', 'SOC', 6, 'Explores the relationship between society and the environment, studying environmental attitudes, movements, policies, and the social dimensions of environmental issues.', 'Graduate'),
('VA2000', 'Introduction to Art', 'ART', 3, 'Studio course designed to introduce first-year students to exercises that challenge their assumptions of the creative process. This course will begin to provide students with the basic visual and verbal vocabulary to proceed to the next level in the Visual Arts curriculum. The exercises will be completed using both, the fundamentals of basic art techniques such as drawing, painting, modeling and fabricating, and references from contemporary art currents.', 'Undergraduate'),
('VA2010', 'Introduction to Creative Thinking', 'ART', 3, 'A must for students considering careers in advertising, publishing, communications or any other discipline regarding creative visual solutions. Students solve exercises designed to challenge the way we perceive reality through conditioning and stereotypes. A variety of skills are developed at the beginners level. The objective is to develop in the students the skills to make creative visual statements avoiding conventional thinking. Required for Art majors.', 'Undergraduate'),
('VA2020', 'Basic Design', 'ART', 3, 'This studio course deals with the fundamental development of visual structures and the relationship among two, three, and four (time) dimensions. Through structured projects, beginning with point and visual rhythm, the course will explore line, plane, and color. Students will learn the fundamental principals to organizing these multi-dimensions as they relate to graphics, interior design, photography, etc. and how to make informed intelligent visual decisions. The relationship between the traditional crafts such as painting, sculpture and the new electronic media arts will be discussed and studied. Required for all art majors.', 'Undergraduate'),
('VA2030', 'Drawing', 'ART', 3, 'The process of art from idea to final product. The emphasis is on visual notations, especially drawings. Deals with planning and studying feasibilities before actually entering production, allowing students to work through an idea. Required for all art majors.', 'Undergraduate'),
('VA2045', 'Introduction to Color', 'ART', 3, 'This class is for those who were always afraid of color and mystified on how color combinations work. The course will be a studio class using paint and paper working through a series of projects exploring: color theory and terminology, how it is applied to practical situations; the difference between subtractive systems as seen in the chemical world of paint and the additive system as demonstrated in electronic media and the calibration of computer monitors and color systems such as RGB, CYMK, etc. How harmonic-complementary and discordant uses of color are used in nature; after images and optical mixes of color; camouflage and how it works in nature and design; color in relation to 3-dimentional form and more will be addressed. Satisfies Liberal Education Curriculum requirement.', 'Undergraduate'),
('VA2320', 'Graphic Design I', 'ART', 3, 'This course introduces the elements and principles of graphic design as building blocks that lead to effective visual communication. A series of projects focus on developing problem solving skills as well as knowledge of the software involved in creating successful design projects. Several influential design movements are covered in relation to specific principles of design. Emphasis is placed on taking initial ideas through to fully realized projects that communicate effectively. Areas covered include typography, page layout, book design, packaging and logo design, poster design and design for the web. Projects will be created in Adobe software: InDesign, Photoshop, Illustrator and Dreamweaver.', 'Undergraduate'),
('VA2400', 'Introduction to Photography', 'ART', 3, 'Beginning course for art-majors and non-art majors in photography. Emphasis is on photography as a system of visual and cultural representation. The history of photography and technical data are interspersed with shooting assignments and critique. Students supply their own materials and should own a medium-quality digital camera.', 'Undergraduate'),
('VA2460', 'Painting I', 'ART', 3, 'This is a beginning course, which teaches the student the conventions of pictorial space and the language of color, as well as basic painting techniques. The study of syntax of traditional painting and the mastery of materials and techniques are basic components of the class. Class assignments and individual projects explore technical, conceptual, and historical issues central to understanding the language of painting. Paintings from different historical periods are discussed in relation to contemporary painting today.', 'Undergraduate'),
('VA2500', 'Art History I: 19th Century Art', 'ART', 3, 'This class begins with the history of Modern Art in 1750 in the context of the Enlightenment and the French Revolution. It covers the major movements in European Art including Neo Classicism, Romanticism, Realism, Impressionism, and Post-Impressionism. Artistic developments are presented within their historical and social contexts. We will study the changing role of art in by considering the impact that dramatic political upheavals and the Industrial Revolution had on the idea and production of art.', 'Undergraduate'),
('VA2510', 'Art History II: Modern Art: 1900- 1945', 'ART', 3, 'This second part of the survey begins with the art of the twentieth century. It examines the many challenges to the definition and role of art that emerge from the major movements of the century such as Cubism, Surrealism, Dada, and Abstract Expressionism. The course traces the impact of photography, mass production, and politics on the role of art in early 20th century society. It also examines the split that occurs between artists who wish to make politically engaged art and artists who wish to make art for artâ€™s sake.', 'Undergraduate'),
('VA3100', 'Visual Culture: Warhol to the Present', 'ART', 3, 'This course examines the role of art in a contemporary society inundated with visual imagery. We will situate the major art movements of the 1960s and 70s (Pop, Minimalism, Conceptual Art, Performance and Post Modernism) within the socio- historical context of the Civil Rights Movement, the Vietnam War and the development of contemporary technologies. The course considers how contemporary art comments upon such diverse issues of race, gender and sexuality. We will also look at how the critic, the gallery, and the museum help to determine how art is defined. Required for all Art majors.', 'Undergraduate'),
('VA3200', 'Art Tutorials I', 'ART', 3, 'Art majors must meet in tutorial sessions with the instructor to discuss ongoing work in any media. Criticism is geared to development of self confidence in the creative process and to implement technical and productive solutions. All students are required to meet with collective faculty for criticism. Required for all Art majors. (Teacher Education majors who have selected the Visual Arts concentration will learn to analyze the creative process as it relates to the classroom; how to conceptualize, and plan projects that explore creativity.)', 'Undergraduate'),
('VA3380', 'Digital Video', 'ART', 3, 'Students will obtain a strong foundation in digital video on the Macintosh computer through instruction in preproduction and production fundamentals. Video editing will be done with Adobe Premiere software. Students will have their own computer workstations and access to cameras, recorders, color scanners and printers. This course will provide students with the knowledge of the aesthetic, critical and analytical processes required to create effective digital videos.', 'Undergraduate'),
('VA3400', 'Digital Imaging', 'ART', 3, 'This course covers the capabilities of both pixel-based and vector-based digital imaging software. Using Photoshop, students create a range of projects that explore the creative potential within these programs while developing the skills necessary to execute original concepts. This course serves as a digital foundation upon which more advanced digital work in both 2D and 3D design can be built. It is a must for anyone considering a career in communications, publishing, advertising and the visual arts.', 'Undergraduate'),
('VA3456', 'Creative Coding: Art & Games', 'ART', 3, 'Creative Coding: Art and Games focuses on the development of a contemporary art practice incorporating interactivity and technological developments from the ground up for the creation of Art and Art-based games. What types of artworks can be conceptualized and produced when incorporating computing power? Students will learn the basics for working within the realm of physical computing; computer interfaces that go beyond the typical keyboard and mouse. The course will begin instruction with small-scale programmable computers called microcontrollers and students will become familiar with building electronic circuits in service of creative output. This course will also explore generative visual output through the fundamental steps and concepts of programming including variables, conditionals, iteration, and functions. Particular attention will be focused on creation of interactivity, whether this includes controlling and programming digital games or physical and digital artwork. This course will utilize weekly exercises to build dedicated technical skills, discussions and readings to foster critical understandings of the interactive media possibilities, and midterm and final projects to explore personal interests with conceptual rigor and creative freedom.', 'Undergraduate'),
('VA4200', 'Art Tutorials II', 'ART', 3, 'This course is the second level of the Tutorial Sequence. Required for all Art majors. (Teacher Education majors who have selected the Visual Arts concentration will focus on how to teach the creative process.) This is the second level of the tutorials sequence that focuses on the processing of studentsâ€™ own projects. Materials, techniques, and theory of criticism will be covered.', 'Undergraduate'),
('VA4320', 'Graphic Design II', 'ART', 3, 'This course builds upon the elements and principles of graphic design outlined in Graphic Design I. Students will develop concepts that lead to effective design solutions across media platforms including: print design, packaging and logo design, web, eBook and environmental design. Students will use a variety of Adobe software: InDesign, Photoshop, Illustrator, Dreamweaver, Flash and ePub.', 'Undergraduate'),
('VA4460', 'Digital Animation', 'ART', 3, 'This course teaches the principles of storyboarding, digital imaging, stop-motion animation, cel animation, key frame animation and sound. Utilizing Adobe software, students will conceptualize, design, draw and compose digital animations.', 'Undergraduate'),
('VA5200', 'Art Tutorials III', 'ART', 3, 'This course is the third level of the Tutorial Sequence. Required of all Art majors. (Teacher Education majors who have selected the Visual Arts concentration will focus on research skills, delving into the value of the creative process in art, as it applies to problem solving, and the relationship of the creative process in art as it relates to other fields and disciplines.)', 'Undergraduate'),
('VA5900', 'Senior Project', 'ART', 3, 'Upon recommendation of the VA faculty and with the student holding a minimum GPA of 3.0 in Art Tutorials II and Art Tutorials III, the Student will create art work for an exhibition at the campusâ€™ Amelie A. Wallace Gallery. Other Art Majors who have finished the Art Tutorial sequence, but are not recommended for a final exhibition, will instead write a final Senior Thesis. This thesis will address an art topic to be decided on, in consultation with the Visual Arts Faculty. Teacher Education majors who have selected the Visual Arts concentration will use Senior Project as an opportunity to assemble a final portfolio of sample art projects, a written journal of classroom observations and techniques and a research paper on the possibilities of integrating the art process into the classroom as a learning tool. Seniors passing Senior Project - Art Exhibition will receive recommendations for MFA programs. Students who choose to graduate with a thesis will be recommended into MA programs.', 'Undergraduate'),
('VA6100', 'Advanced Studio Practice', 'ART', 6, 'Focuses on individual artistic development, experimentation, and mastery of techniques across various visual art mediums, encouraging students to refine their artistic voice.', 'Graduate'),
('VA6150', 'Contemporary Art Theory and Criticism', 'ART', 6, 'Explores critical theories, discourses, and debates in contemporary art, analyzing the socio-cultural context and conceptual frameworks shaping artistic practices today.', 'Graduate'),
('VA6200', 'Art History and Visual Culture', 'ART', 6, 'Surveys art history from diverse perspectives, examining the evolution of visual culture, artistic movements, and their socio-political contexts to understand the interconnectedness of art and society.', 'Graduate'),
('VA6250', 'Digital Media and New Technologies in Art', 'ART', 6, 'Explores the integration of digital tools and technologies in art creation, covering topics such as digital imaging, interactive media, virtual reality, and their artistic applications.', 'Graduate'),
('VA6300', 'Drawing and Illustration Techniques', 'ART', 6, 'Focuses on advanced drawing techniques, including figure drawing, composition, rendering, and experimental approaches, allowing for artistic exploration and expression.', 'Graduate'),
('VA6350', 'Sculpture and 3D Art Practices', 'ART', 6, 'Explores sculptural techniques, material exploration, installation art, and spatial concepts, encouraging students to engage with three-dimensional forms and their conceptual possibilities.', 'Graduate'),
('VA6400', 'Printmaking and Graphic Arts', 'ART', 6, 'Covers traditional and contemporary printmaking techniques such as etching, lithography, screenprinting, and digital print media, fostering experimentation in print-based art.', 'Graduate'),
('VA6450', 'Curatorial Studies and Exhibition Design', 'ART', 6, 'Examines curatorial practices, exhibition design, art curation, and gallery management, preparing students for roles in organizing and presenting visual art exhibitions.', 'Graduate'),
('VA6500', 'Photography and Lens-Based Media', 'ART', 6, 'Explores photographic techniques, visual storytelling, digital imaging, and the critical analysis of photographic practices in contemporary art and visual culture.', 'Graduate'),
('VA6550', 'Performance Art and Interdisciplinary Practices', 'ART', 6, 'Explores the intersection of visual arts with performance, time-based media, and interdisciplinary approaches, encouraging experimentation across different artistic forms.', 'Graduate');
